In Navy Red', '1'),
(12, 39485, 'Travis Scott x Nike Air Max 1 Colorway to Release this Week', '&lt;p&gt;After collaborating with Hiroshi Fujiwara and his fragment design label for the two Air Jordan 1, Travis Scott is preparing to expand his highly sought-after footwear catalog, now with &lt;a href=&quot;https://www.2021sneakers.com&quot;&gt;&lt;strong&gt;2021Sneakers&lt;/strong&gt;&lt;/a&gt; The family is linked together. The next La Flame and Swoosh are the complete series of Air Max 1, and the latest color scheme has just surfaced. This latest makeup look is very similar to the interpretation of &quot;Baroque Brown&quot;, but it has been slightly adjusted in the upper part to make it independent. The mesh padding and the reverse canvas swooshish are all dialed into a natural white hue and are covered around the toe box, the middle foot and high heels are wrapped in the appropriate &quot;wheat&quot; hue for autumn. From here on, the popular red color stands out from the hiking-style shoelaces. Checked straps appear on the shoe body and heel, as well as the flag-shaped decoration on the heel. The shoe on the left has the Nike brand and the shoe on the right. There is Cactus Jack on it.&lt;/p&gt;&lt;p&gt;&lt;br /&gt;After the first collaboration earlier this year, &lt;a href=&quot;https://www.newdropjordans.com&quot;&gt;&lt;strong&gt;New Drop Jordans&lt;/strong&gt;&lt;/a&gt; and Vans once again joined forces to launch a second series. The new release focuses on the Sk8-Hi silhouette, and sees the brand mascot Jeremy’s duck as a different graphic approach. This classic skate is available in three colors, each with a mushroom print. On the &quot;black/blue&quot;, &quot;cotton candy&quot; and &quot;yellow&quot; uppers, the Palace name is spelled out with fungus-inspired patterns, and each heel is also decorated with an embroidered mushroom logo. Each color scheme has a checkerboard label hung on the jazz stripe, and a tongue sticker for the joint brand of Palace and Vans. Check out the gallery above and the latest Vans collaboration from Palace in the promotional video. All three Sk8-Hi color schemes will be released online on November 5th, and will be released in physical stores in London, New York and Los Angeles, in Tokyo, and through WeChat a day later.&lt;/p&gt;&lt;p&gt;&lt;br /&gt;Performance footwear and clothing brand HOKA has collaborated with Moncler to redesign the Mafate Speed ​​2 running shoes. &lt;a href=&quot;https://www.heydudeshoesforgirls.com&quot;&gt;&lt;strong&gt;Hey Dude Shoes&lt;/strong&gt;&lt;/a&gt; ,The redesigned contour is suitable for constructions prepared for mountainous and all-terrain performance. The shoes are characterized by a white and silver design with the iconic geometry of HOKA and the names of Moncler and HOKA. This shoe focuses on technical terrain, with a thick midsole support and Vibram Megagrip outsole to increase traction. This shoe uses Mon-Cola&#039;s tri-color details and its iconic Mon-Cola tongue patch. Last month, Moncler launched its first perfumes &quot;Moncler Pour Homme&quot; and &quot;Moncler Pour Femme&quot; through its &quot;Moncler Genius&quot; project. Men&#039;s fragrances are characterized by cedar, sandalwood, sage, vetiver and citrus, while women&#039;s fragrances are characterized by Italian bergamot, jasmine samba, heliotrope, amber, vanilla, etc. The limited edition Moncler x HOKA Mafate Speed ​​2 priced at £215 (approximately US$294) is now available in Moncler House of Genius stores, pop-up windows and some Moncler boutiques around the world. In addition, it will be available on HOKA.com from December 1, 2021.&lt;/p&gt;', 'Travis Scott x Nike Air Max 1 Colorway to Release this Week', '1635942188', 5, 'upload/photos/2021/11/I8MxqSog9KO6xszuMGBp_03_621ea282cadad3a0adb4e33ba8931edf_image.jpg', 127, 0, 'Travis Scott x Nike Air Max 1 Colorway to Release this Week', '1'),
(13, 39500, 'Stylish Todd Bratrud x Nike SB Dunk High Strawberry Cough Red', '&lt;p&gt;Have you been following the latest footwear news on the exclusive supplier website? If you missed it, the famous Japanese designer Jun Takahashi has collaborated with Chitose Abe and Swoosh brands to create a new look for their coveted sacai LDWaffle cut . &lt;a href=&quot;https://www.sneakerheads2020.com&quot;&gt;&lt;strong&gt;Sneakerheads2020&lt;/strong&gt;&lt;/a&gt; take a closer look at the new UNDERCOVER x sacai x Nike LDWaffle Bright Citron, which is undoubtedly one of the best products we have seen in a while. The official pictures of these three-brand shoes show colors including gray, black, sail and yellow. These tones are decorated with mixed leather, suede and nylon uppers, and even surround Abe&#039;s signature double patterns, such as tongue, sidewall Swooshes, laces, toes, and soles. For those who have missed other sacai x Nike products, we recommend you to click the notification ring above, because these are the must-have items for Nike sneaker collectors.&lt;/p&gt;&lt;p&gt;Todd Bratrud x Nike SB Dunk High Strawberry Cough Red sneakers are the latest &lt;a href=&quot;https://www.2021sneakers.com&quot;&gt;&lt;strong&gt;2021Sneakers&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;  &lt;/strong&gt; launched by this Oregon brand in collaboration with the famous illustrator Todd Bratrud. The duo had previously tamed some of the most hyped Dunk all the time the release, and the silhouette reached its peak again, this is just a meaningful new rendition launch. This high-top shoe looks to be a mix of furry suede and tumbling leather, and the design concept is around strawberries. The clean red and green exterior is the logo of Nike SB at the beginning of the 21st century and will definitely be sought after by fans of the brand. The strawberry pattern is located on the back heel, and the insole is also printed with a crazy graphic! Under the sole of the foot, the translucent rubber midsole is also reminiscent of past SB releases and hides high-end cushioning, making these worth adding to Nike&#039;s skateboard center String.&lt;/p&gt;&lt;p&gt;Over the years, Beaverton-based sportswear giant Nike has established a strong presence in the streetwear sector through high-temperature cooperation. &lt;a href=&quot;https://www.eccowomens-shoes.com&quot;&gt;&lt;strong&gt;Ecco Women&#039;s Shoes&lt;/strong&gt;&lt;/a&gt; ,In addition to Virgil Abloh and Travis Scott, Japanese designer Chitose Abe also won the hearts of many people because of her sacai x Nike LDWaffle design. And now, this silhouette has appeared in a new color form, this time with Takahashi&#039;s brand. UNDERCOVER x sacai x Nike LDWaffle Purple Blue is one of the three options in the package. There is no doubt that this pair of shoes must be a must-have for sneaker collectors, so be sure to see why this pair of shoes is so special. The mixed materials the couple saw were suede, smooth leather and nylon. All of these make up the purple, blue, gray and black tones of the entire panel, including sacai&#039;s iconic double Swoosh logo, tongue, toe, laces, and full-length midsole under the sole. The shoes sit on Nike&#039;s famous waffle outsole, providing traction for all terrains.&lt;/p&gt;', 'Stylish Todd Bratrud x Nike SB Dunk High Strawberry Cough Red', '1636337408', 5, 'upload/photos/2021/11/fKGyGfeLuMKYiLeA93rW_08_c36137a572865bed84b02b6b1cc95f51_image.jpg', 126, 0, 'Stylish Todd Bratrud x Nike SB Dunk High Strawberry Cough Red', '1'),
(14, 39500, 'Special Offer DH0775-200 Nike Air Force 1 07 LXX Toasty Rattan', '&lt;p&gt;Joining Nike’s &quot;Lucky Charms&quot; series is Nike Air Force 1 Low LX Lucky Charms. This all-white Air Force 1 has a charming element hanging from the side collar. &lt;a href=&quot;https://www.cadysneaker.com&quot;&gt;&lt;strong&gt;Cadysneaker&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; ,&lt;/strong&gt;The upper is white smooth leather from toe to heel, including contoured Swooshes. White is repeated on the tongue, laces, mesh sock lining, and even the air brand rubber midsole and outsole. All of this makes these golden ornaments that hang down from the top of the eyes and extend to the heels of the feet stand out. The Nike Air Metallic Gold brand on the tongue perfectly matches the charm. Who wouldn’t like Nike’s Air Force 1 07 Light Bone? The upgraded version of this classic basketball shoe seamlessly blends crunchy frosted leather and Nike air cushions, making it a light and comfortable walk to work, cafes, basically, Anywhere. &quot;Air Force One&quot; may be originally designed for basketball courts, but the modern low-waist silhouette, sleek bone color and streamlined design take these sneakers to a new level, ensuring that all your off-court suits are completed.&lt;/p&gt;&lt;p&gt;The Nike AF1 skull series has become the Halloween tradition of the Swoosh brand. &lt;a href=&quot;https://www.newdropjordans.com&quot;&gt;&lt;strong&gt;New Drop Jordans&lt;/strong&gt;&lt;/a&gt; With the previously released white, black and orange colors, this latest performance is in a striking purple variant. The Nike Air Force 1 &quot;Purple Skeleton&quot; comes in a full smooth and perforated leather upper to show the skeletal foot on its sides and inside. The same purple on the lining of the socks. Like the previous Nike Air Force One Skeleton, this pair of shoes has an outsole that glows in the dark. There are also x-ray foot pictures on the purple insoles. The Nike Air Force 1 logo is featured by the tongue tag and the Nike Air logo sitting on the heel in embroidered white. If you want to add a pair of scary sneakers to your &quot;trick or treat&quot; outfit, look no further. The Air Force No. 1 purple skull will be released in October this year and is a must-have for sneaker fans in the Halloween season.&lt;/p&gt;&lt;p&gt;Nike&#039;s toast series have been launched in these cold months. &lt;a href=&quot;https://www.heydudeshoes.us&quot;&gt;&lt;strong&gt;Hey Dude Shoes&lt;/strong&gt;&lt;/a&gt;,The latest product in this series is the Nike Air Force 1 07 LXX Roasted Rattan. It not only ensures that your feet stay warm and comfortable in autumn and winter, but is also part of Nike&#039;s &quot;zero sports&quot; activities. The foundation of this earth-toned Air Force 1 is a light beige rattan quilted material from the toe box and the lower part of the middle panel. The toe cap, part of the eye stay panel on the forefoot and the collar are the same quilted material, but in a chocolate brown. The foot and heel panel in the eye stop panel are bright orange. The swooshish on the inside and sides are wool black, matching the windmill logo on the eye rest panel, tongue lining and tongue label near the collar. The bright red Toasty patch is also in the Volt color insole.&lt;/p&gt;', 'Special Offer DH0775-200 Nike Air Force 1 07 LXX Toasty Rattan', '1636337675', 4, 'upload/photos/2021/11/zkASbzr3l9dpyFcJ7ATc_08_c30e05c22f5a9d0b94e0b64c91baccd6_image.jpg', 118, 0, 'Special Offer DH0775-200 Nike Air Force 1 07 LXX Toasty Rattan', '1'),
(15, 39500, 'The DA9054-001 Air Jordan 36 “Infrared 23” Releasing Soon', '&lt;p&gt;With the release of &quot;mental energy&quot;, the Air Jordan 36 has cooled down and &lt;a href=&quot;https://www.cadysneaker.com&quot;&gt;&lt;strong&gt;Cadysneaker&lt;/strong&gt;&lt;/a&gt; has been placed on the side of the road for more than a few weeks. But it seems that the latest heir to the throne will finally make a comeback with its new &quot;Infrared 23&quot; color scheme. As its name implies, the couple pays homage to the Air Jordan 6 of the same name, not only reflecting its color palette, but its color blocks are as close as possible. The nominal &quot;infrared&quot; is applied to the decal of the mold, sandwiched between the cold bottom and the dark midsole. Above, the neutrality of the latter is the extensive use of grids, leather paneling, lace units, etc. It is only interrupted by various icon clicks and pull tabs, both of which have the red characteristics mentioned above. A few years ago, the idea of ​​Rick Owens and Converse working together was simply unimaginable. This is due in large part to the designer&#039;s beloved Ramones silhouette, which is often compared to Chuck Taylor. Prior to this, his dunk-decorated with a swooshlike shape on the side-only got a stop order signed by Nike himself.&lt;/p&gt;&lt;p&gt;Originally released in 2000, Nike Air Kukini is a fanatical classic, and its disruptive design can even compete with Air Tuning Max. &lt;a href=&quot;https://www.heydudewomensshoes.com&quot;&gt;&lt;strong&gt;Hey Dude Women&#039;s Shoes&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; ,&lt;/strong&gt;Although it was first retro in 2012, the outline quickly disappeared until Stussy&#039;s interpretation of the outline in 2020. This cooperation allows many people to see the hope of its return, and its return is finally in the near future. This Air Kukini will soon be available in two new colors. The first is a simple, neutral-led undertaking, building what looks like dark green and black fixtures. At the same time, this shoe will also use militaristic colors, mixing light olive and dark olive. A touch of orange, then, highlight the outsole and TPU cage, on the surface is a tribute to the beloved MA-1 jacket. Fast forward to November 2021, and Rick Owens has several collaborations worth watching. Soon, we will see his second interpretation of Chuck 70, which is aesthetically close to the aforementioned Ramones. If you are familiar with its predecessor, then this latest capsule should only bring some surprises. In terms of design, these two shoes are similar to the previous one, offering canvas uppers, slender tongues, thick soles, etc., both high-top and low-top.&lt;/p&gt;&lt;p&gt;After the tragedy of the Astro World Festival in 2021, Travis Scott&#039;s relationship will definitely be reassessed, but more photos of the Houstonian&#039;s upcoming collaboration continue to appear. The latest?: The first time I saw the Air Jordan 1 low OG &quot;reverse Mocha&quot;, it is expected to decline in 2022. In July 2019, Scott launched retro sneakers with &lt;a href=&quot;https://www.cat-boots.us&quot;&gt;&lt;strong&gt;Cat Boots&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; ,&lt;/strong&gt;brown as the mainstay. This is an interesting change. The upcoming sneakers choose the arrangement of heavy white and off-white. The toe box, the middle foot plate, the tongue and the collar, however, are immersed in the tone of the previous Air Jordan 1 Low&#039;s title &quot;Dark Mocha&quot;. La Flame&#039;s iconic backspin pattern on the side reappeared, while &quot;University Red&quot; was animated on the tip of the tongue and heel. At the foot, Scott&#039;s next Air Jordan 1 low-top shoe has been worn on his daughter. The midsole of this shoe is Sail, which looks &quot;old&quot;, and the outsole is dark brown. The combination. However, their color scheme has changed: the low-match is now a more classic black and white match, while the high-contrast one is almost completely white. In addition, the hat toe abandoned the square mold and chose a rounder, disproportionate shape.&lt;/p&gt;', 'The DA9054-001 Air Jordan 36 “Infrared 23” Releasing Soon', '1636548230', 4, 'upload/photos/2021/11/OAoQ1SYVwUG59JP2ZxTD_10_2dee0e0830b3a5014c8d775cbcceb855_image.jpg', 116, 0, 'The DA9054-001 Air Jordan 36 “Infrared 23” Releasing Soon', '1');
INSERT INTO `Wo_Blog` (`id`, `user`, `title`, `content`, `description`, `posted`, `category`, `thumbnail`, `view`, `shared`, `tags`, `active`) VALUES
(16, 39485, 'The Double-Swooshed Air Force 1 Releasing this Week', '&lt;p&gt;Over-branding is not uncommon in Nike&#039;s GRs. Just a few years ago, the brand also put a lot of effort into their Swoosh, adding it to their most classic silhouette. Although not so busy, they maintained the same energy for this version of &lt;a href=&quot;https://www.thenewairforce1.com&quot;&gt;&lt;strong&gt;New Air Force 1&lt;/strong&gt;&lt;/a&gt; , showing the logo twice in one fell swoop. This is not the first time we have seen this pattern. Before wearing blue, the design must have a bright, release-heavy future full of many different color schemes. This pair of shoes chose the &quot;university red&quot; grid, which matches the details of the midsole and the Nike Air brand on the heel and tongue. Elsewhere, white neutral colors lay the foundation, decorative leather fixtures, lace units, and swoos-shaped hollow fillings.In the first collaboration with Nike, Yoon Ahn paid tribute to Air Max 180 and Air Zoom Flight, combining these two products to create a product that is both fresh and precious for designers . For her next project, the ambush head resurrected another classic: air conditioning power. &lt;/p&gt;&lt;p&gt;Since the return of the adidas Forum, &lt;a href=&quot;https://www.newreleaseyeezy.com&quot;&gt;&lt;strong&gt;New Release Yeezy&lt;/strong&gt;&lt;/a&gt; have seen different ways of dressing. The collaborators put it on a belt buckle, printed McDonald&#039;s logo, and even teeth; but as far as the brand is concerned, this shoe basically maintains the OG style. Here, though, we see a mix of new and old forum &#039;84 Hi swapping its usual materials for a complete suede assembly. Although dyed in many different shades, this material still lacks vibrant colors. Only light green can be considered this way, although it is quickly submerged because it appears on the collar, three stripes and outsole. Neutral gray fixtures stand alone in the spotlight, appearing throughout the silhouette, heels and toes. Finally, off-white adds a retro touch to the palette.First released in 1996, Air Adjust Force-just like Air Modify Force-is a basketball silhouette featuring interchangeable shoulder straps, with many team colors selected. Although the demand for this shoe seems to be quite large, in the past 20 years, this shoe has never seen a retro style. However, this situation will soon change, because the ambush company chose it as their next cooperative product. In Yoon&#039;s recent trip to Nike headquarters, Ambush x Nike Air Adjustment Force was a soft and neutral blend. &lt;/p&gt;&lt;p&gt;There is no doubt that in 2021, this tradition of obviously festive and problematic sweaters will continue, and this year&#039;s Air Jordan 1 Mid also wants to join this fun. &lt;a href=&quot;https://www.nikeairforce1shadow.us&quot;&gt;&lt;strong&gt;Nike Air Force 1 Shadow&lt;/strong&gt;&lt;/a&gt;,This ubiquitous costume appears in children-specific sizes, with festive red, green, white, and black colors, but the promotion of decoration is reminiscent of the naughty custom that has been synonymous with Christmas for decades. This Air Jordan 1 mid-term &quot;ugly Christmas sweater&quot; features a patterned sweater on the middle panel, a basketball (looks like a snowflake) and Michael Jordan&#039;s No. 23 jersey on the ankle. Green connects each symbol, realizing a garland-like beauty. The color choice on the ankle changes everything, but it still revolves around the obvious Christmas wave appearance.The black streamline runs through the entire building, dyeing the upper and midsole. White, then, attracted the attention of various brands, especially the &quot;ambush&quot; hit along the heel and check embedded to the side. In addition, the ground rubber is built into the outsole to ensure that Swoosh&#039;s &quot;moving to zero&quot; efforts are further promoted. However, what the founders are missing is the strap itself, which is expected to be available in the future.&lt;/p&gt;', 'The Double-Swooshed Air Force 1 Releasing this Week', '1637197633', 4, 'upload/photos/2021/11/vMA2CLqzPvhiE1JBlzhn_18_2d7fce1f537eefa59ab5d5f74edbb707_image.jpg', 110, 0, 'The Double-Swooshed Air Force 1 Releasing this Week', '1'),
(17, 39500, 'Newest Nike Dunk Low Ice Sneakers Debut for the Holiday Season', '&lt;p&gt;Matthew M. Williams announced that his 1017 ALYX 9SM brand plans to purchase all &lt;a href=&quot;https://www.thenewairforce1.com&quot;&gt;&lt;strong&gt;New Air Force 1&lt;/strong&gt;&lt;/a&gt; High cooperation models. The cooperation project started at Paris Fashion Week in January 2020, and 1017 ALYX 9SM released its first silhouette. In general, there are now 8 different Nike Air Force 1 High colors. The salient feature of all eight designs is the anodized buckle closure on the front, and each has embroidered Swoosh and embossed 1017 ALYX 9SM branding. These eight color schemes are inspired by the classic Air Force 1 series and Nike&#039;s world-renowned Bred color scheme. Throughout the restored package, each design is mirrored with another color movement on its reverse side. This includes &quot;black/white&quot; and &quot;white/black&quot;, as well as &quot;black/black&quot; and &quot;white/white&quot;, &quot;white/wolf gray&quot; and &quot;black wolf gray&quot; and &quot;black/university red&quot; and &quot;university red&quot; /black&quot;.&lt;/p&gt;&lt;p&gt;Following the release of Nike Dunk Low PRM &quot;Vast Grey&quot; sneakers last week, images of Nike&#039;s new holiday Dunk Low &quot;Ice&quot; sneakers also appeared. This upcoming ice sculpture &lt;a href=&quot;https://www.jordan1fearless.com&quot;&gt;&lt;strong&gt;Air Jordan 1 Fearless&lt;/strong&gt;&lt;/a&gt; shoe is inspired by the Harbin International Ice Sculpture Festival. At the Harbin Ice Sculpture Festival, from January to February, several hectares of luminous ice buildings and ice sculptures will be built in Harbin, a city in Northeast China. The upper is covered in silver satin and white velvet. On the side heels and toes, you can see the uncoordinated embroidery of the children playing in the snow and sitting on the sled, while the celebratory flag is arranged on the blue-green embroidered Nike heel label. The inner layer also wears turquoise and red insoles to show the contrast of the Chinese character ice. Below, the gray midsole is raised by the star-dotted translucent outsole to complete the limited edition pair of shoes.&lt;/p&gt;&lt;p&gt;Nike SB team driver and professional skater Ishod Wair released two new installations for his Nike SB Ishod. The last iconic pair of shoes the New Jersey man showed was a &quot;light olive&quot; color with red and brown. &lt;a href=&quot;https://www.hey-dudes.us&quot;&gt;&lt;strong&gt;Hey Dudes&lt;/strong&gt;&lt;/a&gt; The latest duo chose a black/gray and &quot;wheat color&quot; palette from top to bottom, preferring simple monochromatic makeup. In the suede construction blackout upper, the shoe features a wavy quarter panel with vents over a mesh lining, while the tongue fills and the mesh ankle collar fills the top. There are two turbid gray &quot;swishes&quot; on the shoes, one embroidered on the front and the other embedded on the side near the heel. A gray fox line above the midsole adds protection to prevent further damage when skating. The black midsole is equipped with reactive foam, and the sealed gray rubber outsole is molded to have traction properties, and it can hold the board with a stronger grip.&lt;/p&gt;', 'Newest Nike Dunk Low Ice Sneakers Debut for the Holiday Season', '1637585422', 5, 'upload/photos/2021/11/jd6JEniZuZz1U7vRfhQF_22_90d4247e1175374e09295a1ba3026f2b_image.jpg', 104, 0, 'Newest Nike Dunk Low Ice Sneakers Debut for the Holiday Season', '1'),
(18, 39485, 'the CLOT x Air Jordan 5 Low Coming Soon', '&lt;p&gt;&lt;a href=&quot;https://www.2021sneakers.com&quot;&gt;&lt;strong&gt;2021Sneakers&lt;/strong&gt;&lt;/a&gt; has officially acquired sneaker con, a certification service for sports shoes. The transaction further strengthens eBay’s existing relationship with the service and continues to enhance the platform’s reputation in the footwear review process. The Verge website reported that for every pair of sneakers that sell for more than $100, eBay will use sneaker Con to certify the shoes. At the Sneaker Con, this pair of shoes has been reviewed by a large number of professionals and experts. They can ensure that this pair of shoes meets the description on the list and is the original shoe. After review, eBay will send the shoes to the buyer, with a label on the shoes to verify their identity. Since working with Sneaker Con in October 2020, eBay has reviewed approximately 1.55 million pairs of sneakers and 1.9 million pairs are sold on its website every day. In a statement, Jordan Sweetnam, senior vice president and general manager of eBay North America, said: &quot;Our certification services have received a very enthusiastic response. This acquisition allows us to continue to change eBay for every transaction. The transaction brings a higher level of trust and confidence.&quot; In addition to sneakers, eBay also certifies luxury watches and handbags.&lt;/p&gt;&lt;p&gt;The music group and clothing brand Yeti Out, founded by Tom Bray, Arthur Bray, and Erisen Ali, partnered with Vans Hong Kong to launch a double-double for Vans Board Day. &lt;a href=&quot;https://www.newdropjordans.com&quot;&gt;&lt;strong&gt;New Drop Jordans&lt;/strong&gt;&lt;/a&gt; Matching special edition &quot;4SIGHT&quot; Era sneakers. The &quot;4SIGHT&quot; pair of shoes has the classic Vans era silhouette, and the &quot;white/black&quot; and &quot;red/blue&quot; do not match the upper. There are white and black eye patterns on the toes and a snowman logo on the tongue. The lining and insole are worn in beige tones, and are paired with a crisp white rubber sole unit underneath. Part of the income from the sale of sports shoes will be donated to the Hong Kong Center to support poor children. Yeti Out x Vans era &quot;4SIGHT&quot; will soon be available on Yeti Out&#039;s online store and WeChat store. Please continue to follow Yeti Out Instagram below for more updates.&lt;/p&gt;&lt;p&gt;&lt;br /&gt;Following the release of Trapeze Jordan 14 Low &quot;Terracotta&quot; and Trapeze Jordan 35 &quot;Warrior Jade&quot;, we now have a close observation of Clot x Trapeze Jordan 5 Low. The upcoming Jordan Brand&#039;s AJ5 Low model features a smooth black background with red socks and laces. &lt;a href=&quot;https://www.sneakers2090.com&quot;&gt;&lt;strong&gt;Sneakers2090&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; ,&lt;/strong&gt;The matching details include 3M reflective tongue, luminous mesh, jade lace ring and matching lace lock. The brand&#039;s exploration is through the Jumpman pattern on the tongue, the CLOT logo on the back, the &quot;23&quot; Chinese character on the heel and the printed insole. The design of the entire pair of shoes is a black air-assisted midsole and speckled shark teeth details with a jade translucent rubber outsole. It is now expected to arrive sometime next year, so stay tuned for more information about the released thrombus x Air Jordan 5 Low. The &quot;Cool Gray&quot; color scheme of Air Jordan 11 comes back in time for the holidays, so keep this one in mind when giving gifts. This retro sneaker is one of Jordan&#039;s most popular silhouettes, and the re-release marks the 20th anniversary of the color matching industry. This shoe uses a &quot;Cool Grey&quot; (Cool Grey) buttonless upper, a chiseled gray patent leather fender, a beautifully shaped white foam midsole and an ice blue rubber outsole. In addition, the air-sole unit is placed carefully and lightly cushioned and carbon fiber components are added to increase stability.&lt;/p&gt;', 'the CLOT x Air Jordan 5 Low Coming Soon', '1638278785', 4, 'upload/photos/2021/11/XdJMO5K4aRhOPuvO92UE_30_96c2c4892fe3311b205aa11142279966_image.jpg', 103, 0, 'the CLOT x Air Jordan 5 Low Coming Soon', '1'),
(19, 39485, 'Awesome x Vans UltimateWaffle EXP Get An Experimental Sturdy Stitch Upper', '&lt;p&gt;Although their names may be aggressive, their cooperation is usually minimal, and they prefer to celebrate the logo of the various shoes they choose. This is reflected in their latest proposition &quot;UltimateWaffle EXP&quot; (UltimateWaffle EXP). This shoe borrows Van&#039;s expertise and is more experimental than their previous work. After careful observation, the shoes soon began to leave marks. Its structure is made of new sturdy sutures, a TPU-based thread, which is hot pressed to create a viscous monolithic base. In addition, the material is stacked for reinforcement, and multi-layered toe caps are wrapped to prevent wear; a single panel is applied to the eye stay and heel to increase wear resistance without affecting air permeability and bending. RapidWeld technology has also come to help silhouettes, providing more structured midfoot and uppers. Then, various logos are rounded on the tongue and heel. The latter conveys &quot;AV&quot;E&quot; on the other side of the counter, and adds fucking Awesome on the bottom transparent UltimateWaffle sole. Co-branding.&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.favnikeoutlet.com&quot;&gt;&lt;strong&gt;&lt;u&gt;Nike Outlet&lt;/u&gt;&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;    &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.hey-dudes.us&quot;&gt;&lt;strong&gt;&lt;u&gt;Hey Dudes&lt;/u&gt;&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;   &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.vansshoesforwomens.com&quot;&gt;&lt;strong&gt;&lt;u&gt;Vans Shoes For Womens&lt;/u&gt;&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; &lt;/strong&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.skechersshoesoutlets.com&quot;&gt;&lt;strong&gt;&lt;u&gt;Skechers Shoes Outlets&lt;/u&gt;&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;a href=&quot;https://www.nfl-jerseysforcheap.com&quot;&gt;&lt;strong&gt;&lt;u&gt;NFL Jerseys for Ch