(27, 39500, 'DC7701-073 The Jordan Westbrook One Take 3 Goes Greyscale', '&lt;p&gt;&lt;a href=&quot;https://www.mennikeshoes.us&quot;&gt;&lt;strong&gt;Men Nike Shoes&lt;/strong&gt;&lt;/a&gt; will be a whole new chapter for Russell Westbrook. In honor of this, the athlete made a major change to his signature &quot;Why Not&quot; shoe, removing the &quot;zero&quot; that usually accompanies each iteration. While the more affordable Westbrook One Take 3 keeps its name, its silhouette essentially kicks off the new year with a new grey slate. Unlike previous styles, this pair has even an ounce less color. Instead, neutrals complete the look, with nearly everything from the upper to the heel dyed black. However, the embroidered Westbrook and Trapeze branding contrasts in their cream thread, which complements the sole and extra logo on the forefoot. In between, a shade of grey rounds out the color scheme, effectively separating the two opposing hues.&lt;/p&gt;&lt;p&gt;The New Balance XC-72 colorway, which debuted with the help of &quot;Casablanca,&quot; was relatively slow. However, its long teased &quot;Moonlight&quot; style &lt;a href=&quot;https://www.2021sneakers.com&quot;&gt;&lt;strong&gt;2021Sneakers&lt;/strong&gt;&lt;/a&gt; will hit MIT&#039;s web store on January 20. Inspired by sportswear, New Balance has launched a sleek low-top sneaker with a much bolder aesthetic than the dad-related sneakers for which the brand is known. A premium mix of suede, breathable mesh, and rich leather make up the bulk of this shoe, and a ridged heel clip emerges around the heel for structural support. While the XC-72&#039;s upper is an eye-catcher on its own, it&#039;s undoubtedly overshadowed by a &quot;split&quot; outsole that includes a variety of tread patterns borrowed from performance in the &#039;70s and &#039;80s . Beige and black come together to create a perfect shoe for year-round wear, although this shoe will likely dominate spring and summer.&lt;/p&gt;&lt;p&gt;Sandy Liang has such a personal connection to New York that she often guides the city through every design. This is her third collection with Vans, &lt;a href=&quot;https://www.newjordan1.com/&quot;&gt;&lt;strong&gt;New Jordan&lt;/strong&gt;&lt;/a&gt; and the designer thought it would be appropriate to showcase each collection just a few blocks from her Lower East Side storefront. Together, the two created a love letter to &quot;grandma fashion, sporty women, nostalgia, and humor,&quot; all built on top of the footwear brand&#039;s many classics. Both the standard and Platform 2.0 versions of the Sk8-Hi display a childlike femininity, either with lace skirts on the collar or floral embroidery on the canvas. The latter theme appears elsewhere as well, imparting a youthful, playful feel to both the solid and patterned shoes. In contrast, Authentic, which uses a neutral lathe, opted for doodles found in elementary school notebooks, brightly adorned with smiling butterflies. As for the semi-convertible, the pair leaned against lush green Sherpas with subtle flower-shaped eye rings.&lt;/p&gt;', 'DC7701-073 The Jordan Westbrook One Take 3 Goes Greyscale', '1642078323', 4, 'upload/photos/2022/01/Nh5COULZNXXrinzuT3C5_13_83d021707b5d9eccc345fe45b9d61d3e_image.jpg', 65, 0, 'DC7701-073 The Jordan Westbrook One Take 3 Goes Greyscale', '1'),
(28, 39521, 'Hot Sell Air Jordan 11 Low Pure Violet AH7860-101', '&lt;p&gt;The &lt;a href=&quot;https://www.shopjordans2020.com/collection/2022-latest-air-jordan-1-mid-motorsport-for-sale-dj0337-067/&quot;&gt;Air Jordan 1 Mid Motorsport&lt;/a&gt; will drop on February 12, the sneaker uses the &quot;Racer Blue&quot; colorway. We already have some nice pictures of the sneaker to prepare you optimally for this Retro sneaker, which exudes history.This new colorway of the Air Jordan 5 makes great use of a black nubuck construction on the upper, with tonal detailing on the laces, eyelets, inner liner and part of the midsole. The bold Racer Blue hue is applied to the Jumpman logos on the tongues and heels, lace lock and inner tongues. Silver 3M reflective tongues, black shark teeth on the midsole, mesh on the side panels and a blue-tinted translucent outsole with blue Jumpman logos complete the look of this Air Jordan 5.We currently don&#039;t know when the Nike SB Dunk High Pineapple will come. The colourway speaks for a release in summer. As soon as we have more information, you will find it here.&lt;br /&gt;Nike loves &lt;a href=&quot;https://www.jordanukshop.com/2022-air-jordan-11-low-pure-violet-for-sale-ah7860-101/&quot;&gt;Air Jordan 11 Low Pure Violet&lt;/a&gt;. For a while now we&#039;ve been getting more and more silhouettes with pineapple colourways. Some of you may still remember the Happy Pineapple Air Force 1 series or the Air Max 90 Pineapple. Now follows a Nike SB Dunk High Pineapple. All information about the shoe can be found here in the article.We don&#039;t know where the preference for pineapples comes from. But the colourways are always cute and the dunk high is definitely our highlight. If Nike continues like this, we&#039;ll soon have a little fruit shop in our shoe closet.The highlight of the last &quot;Happy Pineapple&quot; pack was the pineapple leather used. Not only is it sustainable, it is also of high quality. This could also explain where Nike&#039;s penchant for pineapples comes from. Based on the first pictures, we can&#039;t say whether this will also be used in this Nike Dunk, but we hope so. The new Pineapple Dunk is definitely made of suede to a large extent. But we can&#039;t really assign the inner elements of the upper. The material looks very fibrous and could also come from the pineapple. We are therefore looking forward to the official product information. The color palette is of course based on the natural colors of the exotic fruit. That means the Botte comes in different shades of yellow and green details.&lt;br /&gt;The &lt;a href=&quot;https://www.lookboosts.com/product-tag/adidas-forum-low/&quot;&gt;adidas Forum Low&lt;/a&gt; is already set to make a splash in 2022. This new colorway is just one of its many to come, its bright blue accents a way to gradually introduce spring themes.Like many of the silhouette&#039;s recent offerings, these don&#039;t stray far from the usual formula. White, as standard, makes up much of the exterior, applied to the sole, leather upper and lace unit. Atop the branding and adjacent accents, however, sky blues and muted greens brighten up the packaging, creating a fresh yet still familiar look.&lt;/p&gt;', 'Hot Sell Air Jordan 11 Low Pure Violet AH7860-101', '1642403849', 4, 'upload/photos/2022/01/8GPxVayxr1Qx7tPBKJ1o_17_60a382f9681b90aecf96e97f0411a973_image.jpeg', 65, 0, 's', '1'),
(29, 39485, 'a Trio of PUMA MB.01 Colorways Dropping in February', '&lt;p&gt;After winning Rookie of the Year honors last year, LaMelo Ball &lt;a href=&quot;https://www.sneakerheads2020.com&quot;&gt;&lt;strong&gt;Sneakerheads2020&lt;/strong&gt;&lt;/a&gt; continued his season of play, making him one of the most entertaining point guards in the league. Every brand should be like this when it has a superstar like Ball in the making, PUMA (XETRA:PUM. His first signature sneaker is called the PUMA MB.01, which will be released in February this year for three A new colorway. The German sports brand is ready to team up with Rick  Morty for a &quot;Buzz City&quot; colorway and a &quot;grey/red&quot; look. The best of the bunch is undoubtedly the A collaboration with Rick and Morty. The mismatched pair is inspired by the adult swimming duo and their interstellar adventures. The left shoe is drenched in a vibrant green exterior with bold red accents, and is featured in the The inside of the tongue is paired with Rick&#039;s face. The other half has the opposite hue, with mostly red clothing and green logos, while Morty&#039;s face is attached to the inside of the shoe. Next up is the &quot;Buzz City&quot; iteration, Shout out directly to the Charlotte Hornets. Much of the estate is dyed solid black with &quot;Blue Atoll&quot; which is the color of the team that translates the franchise. The Grey/Red series is the last of the series The multi-tone grey forms on the base layer and inline product on the sole, allowing the bold red wing embroidery and branding to stand out.&lt;/p&gt;&lt;p&gt;YUME, the new Amsterdam-based shoe brand founded by Eva Korsten and Dave Hendriks, is deeply inspired by Japanese culture - it even takes its name from the Japanese word for &quot;dream&quot; The word - thus, it designs sandals, slippers and &lt;a href=&quot;https://www.vansshoesforwomens.com&quot;&gt;&lt;strong&gt;Vans Shoes For Womens&lt;/strong&gt;&lt;/a&gt; slip-ons against the backdrop of traditional styles such as the Geta sandal. Now, the company&#039;s range of vegan shoes is available at London-based concept store UJNG, known for bringing in lesser-known East Asian brands. YUME YUME showcased basic sandals such as the Suki Sandal at its latest launch, a plain leather and EVA foam sandal reminiscent of the Japanese Geta style. Thick Italian vegan leather wraps the front, while the footbed is rectangular in its usual approach. Following Suki is the truck slide, inspired by the shoes that truck drivers wear. So it&#039;s square at the toe, very comfortable and padded, of course made of vegan leather. The products that elevate this season are YUME YUME&#039;s Nawa Camp Low and High. The former is more like a pair of bulging slippers, while the latter uses neoprene socks with webbing on the upper for a more technical look. However, for those who want to actually get out there, there&#039;s no better option than YUME YUME&#039;s hiking sandals. The sandals are black and feature a Vibram mountaineering sole, antibacterial lining, belt buckle and vegan leather.&lt;/p&gt;&lt;p&gt;Adidas and Yohji Yamamoto have had a long-term relationship and have collaborated on the Y-3 sub-label back in 2002, and since then, the glove has reinterpreted many &lt;a href=&quot;https://www.newnikesneakers.co.uk&quot;&gt;&lt;strong&gt;New Nike Sneakers&lt;/strong&gt;&lt;/a&gt; of the iconic three-stripes designs, such as the 4D superstar and many runners recently. , but for now, it returns to UltraBOOST for 2022. The Y-3&#039;s UltraBOOST 22 comes in a &quot;Black/Core White/Chalk Pearl&quot; style that combines a sock-like, laceless Primeknit upper with rubber technical details, an aesthetic that&#039;s hard to find in this shoe. The result is similar to the legendary Y-3 Qasa, with elastic wrapping around the throat and mid-panel of the shoe, creating a comfortable fit. Similar to the Qasa is the UltraBOOST 22&#039;s contrasting heel tab, detailing the Y-3 branding at the top of the UltraBOOST-branded heel card. At the back is a fabric pull-loop that extends from the collar, while the full-length BOOST midsole is paired with a light-gum-toned Continental rubber outsole.&lt;/p&gt;', 'a Trio of PUMA MB.01 Colorways Dropping in February', '1642599274', 5, 'upload/photos/2022/01/ZhveJxlaDmdDwGOZVA9j_19_5c8dad90a16896cf8e5edd3bf54fdd5a_image.jpg', 63, 0, 'a Trio of PUMA MB.01 Colorways Dropping in February', '1'),
(30, 39500, 'To buy best price Air Jordan 1 High OG NRG Rust Pink', '&lt;p&gt;Las Vegas Aces forward Delica Marie has revealed an exclusive copy of the Air Jordan 1, &lt;a href=&quot;https://www.sneakers2090.com&quot;&gt;&lt;strong&gt;Sneakers2090&lt;/strong&gt;&lt;/a&gt; which was given to Jordan Brand athletes. This Air Jordan 1 features a full rainbow/gradient similar to 2017&#039;s &quot;All-Star&quot; Air Jordan 1. Other details include a black-detailed toe box, tongue, laces and a rainbow midsole above the rubber outsole. Nike will celebrate Cortez&#039;s 50th anniversary in 2022. To that end, Sacai of Chitose Abe will be releasing some of Cortez&#039;s collaborative designs. Originally released in 1972, the Nike Cortez was originally designed by Nike co-founder Bill Bowerman. It was released at the height of the 1972 Summer Olympics, which is why it got a rapidly growing public interest. Dressed in the OG color block, the Sacai x Nike Cortez is based on white leather with grey suede overlays accented with contrasting red and blue. Other details include a two-tier combo like LDWaffle, Blazer, and VaporWaffle. Co-branding with visible Zoom Air in the forefoot in special packaging completes the design.&lt;/p&gt;&lt;p&gt;Originally released in 2000, the Air Jordan 6 &quot;Midnight Navy&quot; will make a retro return in Spring 2022. Dressed in a mix of white and midnight navy. &lt;a href=&quot;https://www.nfl-jerseysforcheap.com&quot;&gt;&lt;strong&gt;NFL Jerseys for Cheap&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; &lt;/strong&gt;This Air Jordan 6 has a similar color block to the OG &quot;Sport Blue&quot; release, built with navy accents in contrasting white leather. The Jumpman heel logo completes the design on a translucent outsole. Boston sneaker retailer Concepts and Nike Sportswear have teamed up to release an iconic Air Max 1 to celebrate the model&#039;s 35th anniversary. While inspiration has yet to be revealed, there will be three Concept x Nike Air Max 1 colorways to choose from, including a range of colors, premium materials, patterns and special details. Each pair comes with mismatched Swooshes, a slash star moon symbol embroidered on the toe box, and a worn &quot;NIKE&quot; heel branding. Concept branding on the tongue label, guitar pick tag, heel, insole housed in a decorative branded box to complete the design.&lt;/p&gt;&lt;p&gt;The adidas Yeezy Boost 350 V2 &quot;Dazzling Blue&quot; is a brand new Yeezy Boost 350 V2 that &lt;a href=&quot;https://www.buycheapyeezy350.com&quot;&gt;&lt;strong&gt;Buy Cheap Yeezy 350&lt;/strong&gt;&lt;/a&gt; will be released in Spring 2022. The adidas Yeezy Boost 350 V2 features a similar color block to the three Black Friday 2016 releases, and it features a black Primeknit upper with a dazzling blue stripe from heel to toe emblazoned with SPLY- 350 brand. Other details include a closed, full-length Boost-cushioned midsole. In 2017, the Air Jordan 1 High OG &quot;Rust Pink&quot; was released with the &quot;Igloo&quot; duo as an exclusive to Art Basel Miami. This offering of the Air Jordan 1 features a white leather upper with black leather overlays on the fenders, eye stops, and collar. Highlighting the shoe is the rust powder contrast accent on the heel, ankle, and rubber outsole.&lt;/p&gt;', 'To buy best price Air Jordan 1 High OG NRG Rust Pink', '1643031279', 4, 'upload/photos/2022/01/2HyEQhSurdFUm961kga7_24_650a12f7415799ec83023ffc65a59eb6_image.jpg', 53, 0, 'To buy best price Air Jordan 1 High OG NRG Rust Pink', '1'),
(31, 39521, '2022 Latest Released Air Jordan 13 Brave Blue DJ5982-400', '&lt;p&gt;We&#039;ve just shown you the full official images of the &lt;a href=&quot;https://www.jordanukshop.com/product-tag/2022-jordan-release/&quot;&gt;2022 Jordan Release&lt;/a&gt;; now here&#039;s a look at the &quot;Barley&quot; yellow colorway, which is also set to drop at the end of the Spring 2022 season or the start of the Summer 2022 season. This women&#039;s exclusive release follows the simple formula of adding a Crisp two-tone colourway based on White, with a color-matched paisley pattern adorning the Swoosh and heel patches.The star here is this new Barley colorway, which is an earthier shade of yellow than the Pollen Yellow seen on last year&#039;s Air Jordan 1 Retro High OG or the University Gold seen in a variety of Nike shoe silhouettes. . Like the other women&#039;s Paisley Dunk options, these featured clean white laces to match the tongues and nylon midsoles for the perfect spring/summer look.&lt;br /&gt;As for the &lt;a href=&quot;https://www.shopjordans2020.com/product-tag/cheap-air-jordan-1/&quot;&gt;Cheap Air Jordan 1&lt;/a&gt; project, photos of the &quot;Camo&quot; and &quot;Bandana&quot; versions have already leaked to the network. Today we have a photo of the Military Green version for you.As with previous versions, the upper parts of the upper are made of washed, light denim. In his company you will see a real mix of materials that have replaced the classic mesh and suede. We are talking about horsehair (here in colors imitating a giraffe), corduroy (on the heel) covered with a white pattern, and rip stop nylon walking just above the sole, which has been dyed green. There are also maroon velvet laces. All this will be put on a white spotted sole.&lt;br /&gt;The first images of the &lt;a href=&quot;https://www.lookboosts.com/product-tag/cheap-yeezy-boost-350-v2-dazzling-blue/&quot;&gt;Cheap Yeezy Boost 350 V2 Dazzling Blue&lt;/a&gt; have been teased. The release date of this sneaker is not yet known, but the drop is expected in the course of the year.The new Air Jordan 1 Mid has an upper made of leather. The collar, Swoosh, lacing eyelets and front overlays are coloured black. The middle panel and toe box are in white. This makes the colour on the rear overlays stand out more.Nike calls the colour on the rear overlays &#039;Amethyst&#039;. These overlays are made of textile and has a combination of purple tones. The Wings logo is in black, just above the ankle. The overlays mimic the colour of the amethyst crystal, which is also made up of different shades of purple. This colourway also appears on the Air Jordan 4 &#039;Amethyst Wave&#039; which will be released in March.The amethyst is a mineral quartz and one of the best-known crystals in existence. In the spiritual world, the crystal has a protective, purifying and relaxing effect. The crystal provides harmony and inner peace.&lt;/p&gt;', '2022 Latest Released Air Jordan 13 Brave Blue DJ5982-400', '1643101549', 4, 'upload/photos/2022/01/PnP9eekWsxpkPDMPMmv1_25_918d917c887817a362c7fc2b94ae288b_image.jpg', 54, 0, 's', '1'),
(32, 39521, 'Buy Air Jordan 11 Low Pure Violet AH7860-101', '&lt;p&gt;A short time ago we said that the &lt;a href=&quot;https://www.jordanukshop.com/product-tag/air-jordan-11/&quot;&gt;Air Jordan 11&lt;/a&gt; is usually more calm than the Jordan 1 Mid and only rarely wears super crazy colourways. In the sneaker world, however, people are always taught a better lesson and today we have the first pictures of the Air Jordan 1 High Anodized. He&#039;s anything but calm. All information about the leaked pictures can be found here in the post.Whether low, mid or high, 1 Series Jordans are simply the perfect canvas for freaky colourways. There are so many panels that can be designed differently and stories naturally work on a shoe steeped in history. And no matter how many colourways Nike serves us, we certainly won&#039;t get enough.&lt;br /&gt;As the name suggests, the &lt;a href=&quot;https://www.shopjordans2020.com/product-tag/2022-jordan-1/&quot;&gt;2022 Jordan 1&lt;/a&gt; comes almost completely anodized. For everyone who is now wondering what the hell that actually means or is: Anodizing is an electrochemical process. This makes the metal surface more resilient and corrosion-resistant. Of course, the process is also used for decorative purposes, because the positive side effect is that the color can be changed to a certain extent. Because the result often ends up in a super nice color gradient, this process is often imitated in the fashion industry, on leather.For the Jordan, they opted for a bright blue, almost green, color gradient on the upper. The gradient is broken in black with the toebox, swoosh and laces. Eye-catching design, which will definitely find some fans.&lt;br /&gt;As the world eagerly awaits the Nike StreakFly for peak performance in 5K and 10K, the Swoosh continues to outfit its revolutionary Nike ZoomX AlphaFly NEXT% in colorways suitable for race day.Similar to previously seen styles of the ultra-cushioned silhouette, the ATOMKNIT construction throughout the upper features much of the pair&#039;s flair. Purple and coral tones combine to deliver a spring-ready combination; Exposed ZoomX foam near the forefoot also indulges in vibrant hues, coating them in a gradient fashion. Accompanying detailing throughout the upper opts for an understated Black colourway, which also lands on the tried-and-true outsole underfoot. Finally, the visible Zoom Air units at the ball of the foot bring some of the style of the upper half below, as they both proudly feature the aforementioned rosy tone.&lt;br /&gt;This &lt;a href=&quot;https://www.lookboosts.com/product-tag/adidas-yeezy-400-boost/&quot;&gt;adidas Yeezy 400 Boost&lt;/a&gt; will release on February 3rd, 2022. At the time of writing, it remains to be seen whether this will be done via the SNKRS App or via the Nike website itself. You can keep an eye on the upcoming sneakers from Nike via the links below. When this Dark Marina Blue is loaded, you will see that immediately.On February 1st, according to the Chinese calendar, the new year starts. The coming year will be the year of the tiger. The tiger increases the chance of a turbulent year, think of social unrest and natural disasters. Nevertheless, the tiger always lands on its feet again and everything will end well.The Nike Dunk High with this years theme has different colours and materials on the upper. The toebox and nose have a light grey colour and are made of suede. On the toe box is a mini Swoosh in gold and on the toe box are Chinese characters in the same colour.The rest of the upper is in black. The side and heel are made of a slightly rougher suede. The overlays have a satin look with black embroidery on them. Around the heel, golden tiger stripes are embroidered. There are also gold embroideries on the tongue.&lt;/p&gt;', 'Buy Air Jordan 11 Low Pure Violet AH7860-101', '1643383099', 5, 'upload/photos/2022/01/EgGMxMWc8DyoYSME6vZH_28_c69cc0d2b721c07bbace129764183010_image.jpeg', 55, 0, 's', '1'),
