(1287, 'good_morning_quote', '', 'Every new day is a chance to change your life.', 'كل يوم جديد هو فرصة لتغيير حياتك.', 'Elke nieuwe dag is een kans om je leven te veranderen.', 'Chaque nouveau jour est une chance de changer de vie.', 'Jeder neue Tag ist eine Chance, dein Leben zu verändern.', 'Ogni nuovo giorno Ã¨ un\'opportunitÃ  per cambiare la tua vita.', 'Todo novo dia é uma chance de mudar sua vida.', 'Каждый новый день - это шанс изменить вашу жизнь.', 'Cada nuevo día es una oportunidad para cambiar tu vida.', 'Her yeni günde hayatınızı değiştirmek için bir şans.', 'Chak nouvo jou ou wè se yon opòtinite ou genyen pou chanje lavi ou.'),
(1288, 'good_afternoon_quote', '', 'May this afternoon be light, blessed, enlightened, productive and happy.', 'نرجو أن يكون هذا المساء خفيفًا ومباركًا ومستنيرًا ومنتجًا وسعيدًا.', 'Moge vanmiddag licht, gezegend, verlicht, productief en gelukkig zijn.', 'Puisse cet après-midi être léger, béni, éclairé, productif et heureux.', 'Möge heute Nachmittag hell, gesegnet, erleuchtet, produktiv und glücklich sein.', 'Possa questo pomeriggio essere leggero, benedetto, illuminato, produttivo e felice.', 'Que esta tarde seja leve, abençoada, iluminada, produtiva e feliz.', 'Пусть сегодня днем светлый, благословенный, просвещенный, продуктивный и счастливый.', 'Que esta tarde sea luz, bendita, iluminada, productiva y feliz.', 'Bu öğleden sonra hafif, kutsanmış, aydınlanmış, üretken ve mutlu olabilir.', 'May this afternoon be light, blessed, enlightened, productive and happy.'),
(1289, 'good_evening_quote', '', 'Evenings are life’s way of saying that you are closer to your dreams.', 'الأمسيات هي طريقة الحياة للقول بأنك أقرب إلى أحلامك.', 'Avonden zijn de manier om te zeggen dat je dichter bij je dromen bent.', 'Les soirées sont la manière de la vie de dire que vous êtes plus proche de vos rêves.', 'Abende sind die Lebensart zu sagen, dass Sie Ihren Träumen näher sind.', 'Le sere sono il modo in cui la vita ti dice che sei piÃ¹ vicino ai tuoi sogni.', 'As noites são a maneira da vida de dizer que você está mais perto de seus sonhos.', 'Вечера - это способ жизни сказать, что вы ближе к своим мечтам.', 'Las noches son la forma en que la vida dice que estás más cerca de tus sueños.', 'Akşamlar yaşamın, hayallerinize daha yakın olduğunuzu söyleme biçimidir.', 'Evenings are life’s way of saying that you are closer to your dreams.'),
