(1295, 'sign_in_attempt', '', 'Your sign in attempt seems a little different than usual, This could be because you are signing in from a different device or a different location.', 'تبدو محاولة تسجيل الدخول مختلفة قليلاً عن المعتاد ، وقد يرجع هذا إلى أنك تقوم بتسجيل الدخول من جهاز مختلف أو موقع مختلف.', 'Uw inlogpoging lijkt een beetje anders dan anders. Dit zou kunnen zijn omdat u zich aanmeldt vanaf een ander apparaat of een andere locatie.', 'Votre tentative de connexion semble légèrement différente de celle habituelle. Cela peut être dû au fait que vous vous connectez depuis un autre appareil ou un autre emplacement.', 'Ihr Anmeldeversuch scheint ein wenig anders als sonst. Dies könnte daran liegen, dass Sie sich von einem anderen Gerät oder einem anderen Standort aus anmelden.', 'Il tuo tentativo di accesso sembra leggermente diverso dal solito. Ciò potrebbe essere dovuto al fatto che stai effettuando l\'accesso da un dispositivo diverso o da un\'altra posizione.', 'Sua tentativa de login parece um pouco diferente do normal. Isso pode ter ocorrido porque você está fazendo login de um dispositivo diferente ou de um local diferente.', 'Ваша попытка входа выглядит немного иначе, чем обычно. Это может быть связано с тем, что вы входите с другого устройства или в другое место.', 'El intento de inicio de sesión parece un poco diferente de lo habitual. Esto podría deberse a que se está iniciando desde un dispositivo diferente o desde una ubicación diferente.', 'Oturum açma girişiminiz normalden biraz farklı görünüyor, Bunun nedeni farklı bir cihazdan veya farklı bir konumdan oturum açmanız olabilir.', 'Tantativ  pou ou konekte fwa sa sanble diferan ke nòmal. Sa ka rive paske ou ap esye konekte ak yon aparèy diferan oubyen yon kote diferan.'),
(1296, 'we_have_sent_you_code', '', 'We have sent you an email with the confirmation code.', 'لقد أرسلنا لك رسالة إلكترونية تحتوي على رمز التأكيد.', 'We hebben u een e-mail gestuurd met de bevestigingscode.', 'Nous vous avons envoyé un email avec le code de confirmation.', 'Wir haben Ihnen eine E-Mail mit dem Bestätigungscode gesendet.', 'Ti abbiamo inviato un\'e-mail con il codice di conferma.', 'Enviamos um e-mail para você com o código de confirmação.', 'Мы отправили вам электронное письмо с кодом подтверждения.', 'Te hemos enviado un correo electrónico con el código de confirmación.', 'Onay kodunu içeren bir e-posta gönderdik.', 'Nou voye yon imèl ba ou ak kòd konfimasyon an.'),
(1297, 'two_factor', '', 'Two-factor authentication', 'توثيق ذو عاملين', 'Twee-factor-authenticatie', 'Authentification à deux facteurs', 'Zwei-Faktor-Authentifizierung', 'Autenticazione a due fattori', 'Autenticação de dois fatores', 'Двухфакторная аутентификация', 'Autenticación de dos factores', 'İki faktörlü kimlik doğrulama', 'Otantifikasyon a 2 faktè'),
(1298, 'to_log_in_two_factor', '', 'To log in, you need to verify your identity.', 'لتسجيل الدخول ، تحتاج إلى التحقق من هويتك.', 'Om u aan te melden, moet u uw identiteit verifiëren.', 'Pour vous connecter, vous devez vérifier votre identité.', 'Um sich einzuloggen, müssen Sie Ihre Identität bestätigen.', 'Per accedere, è necessario verificare la propria identità.', 'Para fazer login, você precisa verificar sua identidade.', 'Чтобы войти в систему, вам необходимо подтвердить свою личность.', 'Para iniciar sesión, necesita verificar su identidad.', 'Giriş yapmak için kimliğinizi doğrulamanız gerekir.', 'Pou ou konekte, ou bezwen verifye idantite ou.'),
(1299, 'sent_two_factor_both', '', 'We have sent you the confirmation code to your phone and to your email address.', 'لقد أرسلنا إليك رمز التأكيد إلى هاتفك وإلى عنوان بريدك الإلكتروني.', 'We hebben je de bevestigingscode gestuurd naar je telefoon en naar je e-mailadres.', 'Nous vous avons envoyé le code de confirmation sur votre téléphone et sur votre adresse e-mail.', 'Wir haben Ihnen den Bestätigungscode an Ihr Telefon und an Ihre E-Mail-Adresse gesendet.', 'Ti abbiamo inviato il codice di conferma sul tuo telefono e sul tuo indirizzo email.', 'Enviamos o código de confirmação para o seu telefone e para o seu endereço de e-mail.', 'Мы отправили вам код подтверждения на ваш телефон и на ваш адрес электронной почты.', 'Le hemos enviado el código de confirmación a su teléfono y a su dirección de correo electrónico.', 'Size onay kodunu telefonunuza ve e-posta adresinize gönderdik.', 'Nou voye kòd konfimasyon an ba ou nan telefòn ak nan imèl ou.'),
(1300, 'sent_two_factor_email', '', 'We have sent you the confirmation code to your email address.', 'لقد أرسلنا إليك رمز التأكيد إلى عنوان بريدك الإلكتروني.', 'We hebben je de bevestigingscode gestuurd naar je e-mailadres.', 'Nous vous avons envoyé le code de confirmation à votre adresse e-mail.', 'Wir haben Ihnen den Bestätigungscode an Ihre E-Mail-Adresse gesendet.', 'Ti abbiamo inviato il codice di conferma al tuo indirizzo email.', 'Nós lhe enviamos o código de confirmação para o seu endereço de e-mail.', 'Мы отправили вам код подтверждения на ваш адрес электронной почты.', 'Le hemos enviado el código de confirmación a su dirección de correo electrónico.', 'Size e-posta adresinize onay kodunu gönderdik.', 'Nou voye kòd konfimasyon an ba ou nan imèl ou.'),
(1301, 'sent_two_factor_phone', '', 'We have sent you the confirmation code to your phone number.', 'لقد أرسلنا إليك رمز التأكيد إلى رقم هاتفك.', 'We hebben je de bevestigingscode naar je telefoonnummer gestuurd.', 'Nous vous avons envoyé le code de confirmation sur votre numéro de téléphone.', 'Wir haben Ihnen den Bestätigungscode an Ihre Telefonnummer gesendet.', 'Ti abbiamo inviato il codice di conferma al tuo numero di telefono.', 'Enviamos o código de confirmação para o seu número de telefone.', 'Мы отправили вам код подтверждения на ваш номер телефона.', 'Le hemos enviado el código de confirmación a su número de teléfono.', 'Telefon numaranıza onay kodunu gönderdik.', 'Nou voye kòd konfimasyon an ba ou nan telefòn ou.'),
(1302, 'two_factor_description', '', 'Turn on 2-step login to level-up your account\'s security, Once turned on, you\'ll use both your password and a 6-digit security code sent to your phone or email to log in.', 'شغّل تسجيل الدخول المكوَّن من خطوتين لتحسين مستوى أمان حسابك ، وبمجرد تشغيله ، ستستخدم كل من كلمة المرور ورمز الأمان المكون من 6 أرقام والمرسلين إلى هاتفك أو بريدك الإلكتروني لتسجيل الدخول.', 'Schakel authenticatie in 2 stappen in om de beveiliging van uw account te verbeteren. Wanneer u eenmaal bent ingeschakeld, gebruikt u zowel uw wachtwoord als een uit 6 cijfers bestaande beveiligingscode die naar uw telefoon of e-mailadres is gestuurd om in te loggen.', 'Activez la connexion en deux étapes pour renforcer la sécurité de votre compte. Une fois activé, vous utiliserez votre mot de passe et un code de sécurité à 6 chiffres envoyé à votre téléphone ou à un courrier électronique pour vous connecter.', 'Aktivieren Sie die 2-stufige Anmeldung, um die Sicherheit Ihres Kontos zu erhöhen. Nach dem Einschalten verwenden Sie sowohl Ihr Passwort als auch einen 6-stelligen Sicherheitscode, der an Ihr Telefon oder Ihre E-Mail-Adresse gesendet wird, um sich anzumelden.', 'Attiva l\'accesso in due passaggi per aumentare la sicurezza del tuo account. Una volta attivato, utilizzerai sia la tua password sia un codice di sicurezza a 6 cifre inviato al tuo telefono o e-mail per accedere.', 'Ative o login em duas etapas para aumentar o nível de segurança da sua conta. Depois de ativada, você usará a senha e um código de segurança de seis dígitos enviados para o seu telefone ou e-mail para fazer login.', 'Включите двухэтапный вход для повышения безопасности своей учетной записи. После включения вы будете использовать как свой пароль, так и 6-значный код безопасности, отправленный на ваш телефон или электронную почту, чтобы войти в систему.', 'Active el inicio de sesión en 2 pasos para subir de nivel la seguridad de su cuenta. Una vez que lo haya hecho, utilizará su contraseña y un código de seguridad de 6 dígitos que se le enviará a su teléfono o correo electrónico para iniciar sesión.', 'Hesabınızın güvenliğini artırmak için 2 adımlı giriş özelliğini açın. Açtıktan sonra, giriş yapmak için hem şifrenizi hem de telefonunuza veya e-posta adresinize gönderilen 6 basamaklı bir güvenlik kodunu kullanırsınız.', 'Aktive 2-etap koneksyon pou ogmante sekirite kont ou a.  Lè ou fin aktive l\', ou pral sèvi ak modpas ou epi yon kòd sekirite 6 chif w\'ap resevwa sou telefòn ou oubyen imèl ou pou ou kapabb konekte.'),
