(1374, 'adult_image_file', 'We have detected some adult content on the image you uploaded, therefore we have declined your uploa', 'We have detected some adult content on the image you uploaded, therefore we have declined your upload process.', 'لقد اكتشفنا بعض محتوى البالغين على الصورة التي قمت بتحميلها ، وبالتالي فقد رفضنا عملية التحميل.', 'We hebben een aantal inhoud voor volwassenen gevonden in de afbeelding die je hebt geüpload. Daarom hebben we je uploadproces geweigerd.', 'Nous avons détecté du contenu réservé aux adultes sur l\'image que vous avez téléchargée. Par conséquent, nous avons refusé votre processus de téléchargement.', 'Wir haben in dem von Ihnen hochgeladenen Bild einige Inhalte für Erwachsene gefunden. Daher haben wir Ihren Upload-Vorgang abgelehnt.', 'Abbiamo rilevato alcuni contenuti per adulti nell\'immagine caricata, pertanto abbiamo rifiutato la procedura di caricamento.', 'Detetámos algum conteúdo adulto na imagem que carregou, por isso, recusámos o seu processo de carregamento.', 'Мы обнаружили контент для взрослых на загруженном вами изображении, поэтому мы отклонили процесс загрузки.', 'Hemos detectado contenido para adultos en la imagen que subiste, por lo tanto, hemos rechazado tu proceso de carga.', 'Yüklediğiniz resimdeki bazı yetişkinlere uygun içerik tespit ettik, bu nedenle yükleme işleminizi reddetti.', 'Nou detekte kèk kontni ki rezève pou granmoun nan imaj ou telechaje a. Se poutèt sa nou bloke l\'.'),
