(1381, 'your_phone_email_verified', 'Your phone number and E-mail have been successfully verified.', 'Your phone number and E-mail have been successfully verified.', 'تم التحقق من رقم هاتفك والبريد الإلكتروني بنجاح.', 'Uw telefoonnummer en e-mail zijn succesvol geverifieerd.', 'Votre numéro de téléphone et votre adresse e-mail ont été vérifiés avec succès.', 'Ihre Telefonnummer und E-Mail-Adresse wurden erfolgreich verifiziert.', 'Il tuo numero di telefono e l\'e-mail sono stati verificati con successo.', 'Seu número de telefone e e-mail foram verificados com sucesso.', 'Ваш номер телефона и адрес электронной почты были успешно проверены.', 'Su número de teléfono y correo electrónico se han verificado con éxito.', 'Telefon numaranız ve E-posta adresiniz başarıyla doğrulandı.', 'Nimewo telefòn ak imèl ou verifye avèk siksè.'),
