(1384, 'confirmation_message_email_sent', 'A confirmation message and email were sent.', 'A confirmation message and email were sent.', 'تم إرسال رسالة تأكيد والبريد الإلكتروني.', 'Een bevestigingsbericht en e-mail zijn verzonden.', 'Un message de confirmation et un email ont été envoyés.', 'Eine Bestätigungsnachricht und eine E-Mail wurden gesendet.', 'Sono stati inviati un messaggio di conferma e un\'e-mail.', 'Uma mensagem de confirmação e email foram enviados.', 'Подтверждение и электронное письмо были отправлены.', 'Se envió un mensaje de confirmación y correo electrónico.', 'Bir onay mesajı ve e-posta gönderildi.', 'Nou voye yon konfimasyon pou ou pa mesaj ak imèl'),
(1385, 'confirmation_email', 'We have sent an email that contains the confirmation code to verify your new email.', 'We have sent an email that contains the confirmation code to verify your new email.', 'لقد أرسلنا رسالة بريد إلكتروني تحتوي على رمز التأكيد للتحقق من بريدك الإلكتروني الجديد.', 'We hebben een e-mail gestuurd met de bevestigingscode om uw nieuwe e-mailadres te verifiëren.', 'Nous avons envoyé un email contenant le code de confirmation pour vérifier votre nouvel email.', 'Wir haben eine E-Mail mit dem Bestätigungscode zur Bestätigung Ihrer neuen E-Mail gesendet.', 'Abbiamo inviato un\'email che contiene il codice di conferma per verificare la tua nuova email.', 'Enviámos um email com o código de confirmação para confirmar o seu novo email.', 'Мы отправили письмо, содержащее код подтверждения, чтобы подтвердить ваш новый адрес электронной почты.', 'Hemos enviado un correo electrónico que contiene el código de confirmación para verificar su nuevo correo electrónico.', 'Yeni e-postanızı doğrulamak için onay kodunu içeren bir e-posta gönderdik.', 'Nou voye yon imèl ki gen kòd konfimasyon pou verifye nouvo imèl ou an.'),
(1386, 'confirmation_message', 'We have sent a message that contains the confirmation code to verify your new phone.', 'We have sent a message that contains the confirmation code to verify your new phone.', 'لقد أرسلنا رسالة تحتوي على رمز التأكيد للتحقق من هاتفك الجديد.', 'We hebben een bericht verzonden met de bevestigingscode om je nieuwe telefoon te verifiëren.', 'Nous avons envoyé un message contenant le code de confirmation pour vérifier votre nouveau téléphone.', 'Wir haben eine Nachricht mit dem Bestätigungscode zur Bestätigung Ihres neuen Telefons gesendet.', 'Abbiamo inviato un messaggio che contiene il codice di conferma per verificare il tuo nuovo telefono.', 'Enviamos uma mensagem que contém o código de confirmação para confirmar seu novo telefone.', 'Мы отправили сообщение с кодом подтверждения для подтверждения вашего нового телефона.', 'Hemos enviado un mensaje que contiene el código de confirmación para verificar su nuevo teléfono.', 'Yeni telefonunuzu doğrulamak için onay kodunu içeren bir mesaj gönderdik.', 'Nou voye yon mesaj ki gen kòd konfimasyon pou verifye nouvo telefòn ou an.'),
(1387, 'confirmation_email_message_text', 'We have sent a message and an email that contain the confirmation code to enable two-factor authenti', 'We have sent a message and an email that contain the confirmation code to enable two-factor authentication.', 'لقد أرسلنا رسالة ورسالة بريد إلكتروني تحتوي على رمز التأكيد لتمكين المصادقة الثنائية.', 'We hebben een bericht en een e-mail verzonden met de bevestigingscode om verificatie met twee factoren mogelijk te maken.', 'Nous avons envoyé un message et un courrier électronique contenant le code de confirmation pour permettre une authentification à deux facteurs.', 'Wir haben eine Nachricht und eine E-Mail mit dem Bestätigungscode für die Zwei-Faktor-Authentifizierung gesendet.', 'Abbiamo inviato un messaggio e un\'email contenente il codice di conferma per abilitare l\'autenticazione a due fattori.', 'Enviamos uma mensagem e um email que contém o código de confirmação para ativar a autenticação de dois fatores.', 'Мы отправили сообщение и электронное письмо с кодом подтверждения, чтобы включить двухфакторную аутентификацию.', 'Hemos enviado un mensaje y un correo electrónico que contiene el código de confirmación para habilitar la autenticación de dos factores.', 'İki faktörlü kimlik doğrulamayı etkinleştirmek için onay kodunu içeren bir mesaj ve e-posta gönderdik.', 'Nou voye yon mesaj ak yon imèl ki gen kòd konfimasyon pou pèmèt ou fè otantifikasyon de faktè a.'),
