s you might be interested in and offering ways for you to experience Vwanu, based on things you and others do on and off Vwanu.</p>\n<ul>\n<li>The Services allow you to create, publish and share short-form videos and to consume videos other users have created and interact with those videos and other users.</li>\n<li>Create and share videos: In particular:</li>\n<li>You can record or import videos into the Services.</li>\n<li>You can edit videos and enrich them with filters and additional elements.</li>\n<li>You can also include Content from other users in your videos, provided the creator of the respective video allows the use of their Content for such purposes. Other users can use your Content in their videos if you will enable the use of your Content for such purposes.</li>\n<li>You can publish videos in the Services so that other users can consume your videos. Videos you post publicly will be available in the Platform.</li>\n<li><strong>Offering customized freedoms to make, associate, impart, find, and offer.</strong></li>\n</ul>\n<p>We create and use tools and offer assets to our local area individuals that help to make their encounters positive and comprehensive, including when we figure they may require help. We likewise have groups and frameworks that work to battle misuse and infringement of our Terms and approaches, just as hurtful and beguiling conduct. We utilize all the data we have-including your data to attempt to keep our foundation secure. We likewise may share data about abuse or unsafe substance with other law authorization.</p>\n<ul>\n<li>You can use the Services and the Platform via the Vwanu Platforms (“Platform”) and the Vwanu Platform (“Platform”). Certain functions are available only in the Platform. Further, not all Services or features may be available in your country or region. Different features may be available in different versions of the Services. Certain features are not available for users under a certain age.</li>\n<li><strong>Creating and utilizing innovations that assist us with serving our developing local area.</strong></li>\n</ul>\n<p>Organizing and analyzing information for our growing community is central to our Service. A big part of our Service is creating and using cutting-edge technologies that help us personalize, protect, and improve our Service on an incredibly large scale for a broad global community. Technologies like artificial intelligence and machine learning give us the power to apply complex processes across our Service. Automated technologies also help us ensure the functionality and integrity of our Service.</p>\n<ul>\n<li>You can share your videos, or videos of others that have enabled sharing, via various messaging services and on third-party social media platforms (e.g. Instagram, Facebook, YouTube, Twitter) by the respective terms of Service.</li>\n<li>You can enter a video description, tags, and various privacy settings when publishing a video.</li>\n<li>You can enter a short biography text and profile picture in your public user profile.</li>\n<li><strong>Giving predictable and consistent encounters across the platform</strong></li>\n</ul>\n<p>Vwanu, which shares technology, systems, insights, and information-including the information we have about you to provide services that are better, safer, and more secure. We also offer ways to interact across the Facebook Company Products that you use, and designed systems to achieve a seamless and consistent experience across the Vwanu Platform.</p>\n<ul>\n<li>You can consume videos that other users have shared publicly or by users you follow.</li>\n<li>The Service provides you with a customized “For You” page in which the Service selects videos to show you based on what the Service determines could be interesting for you. For further information, please see the Privacy Policy.</li>\n<li>The Service provides other ways to find Content for you to consume, e.g. a list of other users’ videos on their profile, a search function, and category selection.</li>\n<li>You can watch live streams of other users.</li>\n<li>Interact with other users: You can interact with users’ Content and other users. In particular:</li>\n<li>Direct messages: You can send direct messages to users if they follow you.</li>\n<li>Likes: You can like videos.</li>\n<li>Comments: Subject to users’ settings, you can post comments on their videos.</li>\n<li>Follows: You can track users. If users restrict their profile, you can only follow users if they approve your request to follow.</li>\n<li><strong>Ensuring access to our Service.</strong></li>\n</ul>\n<p>To operate our global Service, we must store and transfer data across our systems around the world, including outside of your country of residence. The use of this global infrastructure is essential to provide our Service.</p>\n<ul>\n<li><strong>Research and innovation.</strong></li>\n</ul>\n<p>We use the information we have to develop, test, and improve our Service and collaborate with others on research to make our Service better and contribute to the well-being of our community. This includes analyzing the data we have about our users and understanding how people use our Services, for example by conducting surveys and testing and troubleshooting new features.</p>\n<h2><a name=\"_Toc79984957\"></a><strong>4) GENERAL CONDITION</strong></h2>\n<ul>\n<li>We do not guarantee the accuracy, completeness, validity, or timeliness of information listed by us or other users.</li>\n<li>We make material changes to these terms and conditions from time to time, we may notify you either by prominently posting a notice of such changes or via email communication.</li>\n<li>The Platform is licensed to you on a limited, non-exclusive, non-transferable, non-sublicensable basis, solely to be used in connection with the Service for your private, personal, non-commercial use, subject to all the terms and conditions of this agreement as they apply to the Service.</li>\n</ul>\n<h2><a name=\"_Toc79984958\"></a><strong>5) LICENSE TO USE PLATFORM</strong></h2>\n<p>We may provide you with certain information as a result of your use of the Platform or Services. Such information may include but is not limited to, documentation, data, or information developed by us, and other materials which may assist in your use of the Platform or Services (\"Our Materials\"). Subject to this agreement, we grant you a non-exclusive, limited, non-transferable, and revocable license to use Our Materials solely in connection with your use of the Platform and Services. Our Materials may not be used for any other purpose, and this license terminates upon your cessation of use of the Platform or Services or at the termination of this agreement.</p>\n<h2><a name=\"_Toc79984959\"></a><strong>6) USER CONTENT</strong></h2>\n<h3><a name=\"_Toc79984960\"></a>Content Responsibility.</h3>\n<p>The Platform permits you to share Content, post comments, feedback, etc. but you are solely responsible for the Content posted by you. You represent that you have required permission to use the Content.</p>\n<p>When posting Content to the Platform, please do not post Content that:</p>\n<ul>\n<li>contains ill-mannered, profane, abusive, racist or hateful language or expressions, text, photographs or illustrations that are pornographic or in poor taste, inflammatory attacks of a personal, racial or religious nature;</li>\n<li>is defamatory, threatening, disparaging, grossly inflammatory, false, misleading, fraudulent, inaccurate, unfair, contains gross exaggeration or unsubstantiated claims;</li>\n<li>violates the privacy rights of any third party, is unreasonably harmful or offensive to any individual or community;</li>\n<li>discriminates on the grounds of race, religion, national origin, gender, age, marital status, sexual orientation or disability, or refers to such matters in any manner prohibited by law;</li>\n<li>violates or inappropriately encourages the violation of any municipal, state, federal, or international law, rule, regulation, or ordinance;</li>\n<li>uses or attempts to use another\'s account, password, Service, or system except as expressly permitted by the Terms of use uploads or transmits viruses or other harmful, disruptive, or destructive files;</li>\n<li>sends repeated messages related to another user and/or makes derogatory or offensive comments about another individual or repeats prior posting of the same message under multiple emails or subjects.</li>\n<li>Any submitted content that includes, but is not limited to the following, will be refused. If repeated violations occur, we reserve the right to cancel user access to the Platform without advanced notice.</li>\n</ul>\n<ul>\n<li>You Give to Us. As part of our agreement, you also give us the permissions that we need to provide the Service.</li>\n<li>We do not claim ownership of your Permissions content, but you grant us a license to use it.</li>\n<li>Nothing is changing about your rights in your Content. We do not claim ownership of the Content that you post on or through the Service and you are free to share your Content with anyone else, wherever you want. However, we need specific legal permissions from you (known as a “license”) to provide the Service. When you share, post, or upload Content that is covered by intellectual property rights (like photos or videos) on or in connection with our Service, you hereby grant to us a non-exclusive, royalty-free, transferable, sub-licensable, worldwide license to host, use, distribute, modify, run, copy, publicly perform or display, translate, and create derivative works of your Content (consistent with your privacy and application settings). This license will end when your Content is deleted from our systems. You can delete Content individually or all at once by deleting your account.</li>\n</ul>\n<h2><a name=\"_Toc79984961\"></a><strong>7) INTELLECTUAL PROPERTY</strong></h2>\n<p>You agree that the Platform and all Services provided by us are the property of Vwanu, including all copyrights, trademarks, trade secrets, patents, and other intellectual property (\"Our IP\"). You agree that we own all rights, title, and interest in and to the Our IP and that you will not use Our IP for any unlawful or infringing purpose. You agree not to reproduce or distribute Our IP in any way, including electronically or via registration of any new trademarks, trade names, service marks, or Uniform Resource Locators (URLs), without express written permission from us.</p>\n<ul>\n<li>To make the Platform and Services available to you, you hereby grant us a royalty-free, non-exclusive, worldwide license to copy, display, use, broadcast, transmit and make derivative works of any content you publish, upload, or otherwise make available to the Platform (\"Your Content\"). We claim no further proprietary rights in your Content.</li>\n<li>If you feel that any of your intellectual property rights have been infringed or otherwise violated by the posting of information or media by another of our users, please contact us and let us know.</li>\n</ul>\n<h2><a name=\"_Toc79984962\"></a><strong>8) USER OBLIGATIONS</strong></h2>\n<p>Only you have the right to access and use your account. You are responsible for ensuring that your login information remains confidential at all times. Vwanu will assume that if your login is used to access the Services, the user has the legal authority to use such login. If you become aware of unauthorized use of your login, you agree to notify VWANU immediately by email at Vwanu. You remain liable for any activity on your account until VWANU has been notified and has had an opportunity to take appropriate action.</p>\n<ul>\n<li>You hereby acknowledge and understand that each User is solely responsible for all aspects of its own day-to-day operations, including the provision of products (by any method, including through delivery), Service, environment, and overall quality and accuracy.</li>\n</ul>\n<h3><a name=\"_Toc79984963\"></a><strong>Compliance.</strong></h3>\n<ul>\n<li>You hereby acknowledge and understand that each user is solely responsible for any marketing, selling, and provision of any products or services offered to Guests through the Services in compliance with all Applicable Law and Rules. VWANU makes no representation or warranty regarding whether a user holds any applicable permit, license, registration, or another credential for its business; whether terms by a user are true and accurate; or whether a user complies with Applicable Law and Rules, and <a href=\"../\"><strong>Vwanu</strong></a> is not responsible for the quality of the products or services provided by any user on the platform.</li>\n</ul>\n<h2><a name=\"_Toc79984964\"></a><strong>9)NO MALICIOUS OR ILLEGAL USE</strong></h2>\n<p><em>Account Owner and any Authorized User shall not (and shall not allow any third party to):</em></p>\n<ol>\n<li>distribute viruses or other harmful or malicious computer code via or into the Platform;</li>\n<li>engage in any conduct that disrupts or impedes a third party’s use and enjoyment of the VWANU Services;</li>\n<li>use the output or other information generated by the Services for any purpose other than as contemplated by this agreement;</li>\n<li>use the VWANU Services for any use other than Customer’s internal business use;</li>\n<li>use unauthorized modified versions of the Services, including without limitation, to build a similar or competitive Platform or Services or to obtain unauthorized access to the Services;</li>\n<li>use the Services in any way that is contrary to applicable local, state/provincial, federal and foreign laws, including without limitation those relating to privacy, electronic communications and anti-spam legislation.</li>\n<li>VWANU retains all titles to, and, except as expressly licensed herein, all rights to the Services, all copies, derivatives and improvements thereof and all related documentation and materials.</li>\n</ol>\n<h2><a name=\"_Toc79984965\"></a><strong>10) ACCEPTABLE USE</strong></h2>\n<p>You agree not to use the Platform or Services for any unlawful purpose or any purpose prohibited under this clause. You agree not to use the Platform or Services in any way that could damage the Platform, Services, or general business of Vwanu.</p>\n<ul>\n<li>You further agree not to use the Platform or Services:</li>\n<li>To harass, abuse, or threaten others or otherwise violate any person\'s legal rights;</li>\n<li>To violate any of our intellectual property rights or any third party;</li>\n</ul>\n<ul>\n<li>To upload or otherwise disseminate any computer viruses or other software that may damage the property of another;</li>\n</ul>\n<ul>\n<li>To perpetrate any fraud;</li>\n<li>To engage in or create any unlawful gambling, sweepstakes, or pyramid scheme;</li>\n<li>To publish or distribute any obscene or defamatory material;</li>\n<li>To publish or distribute any material that incites violence, hate, or discrimination towards any group;</li>\n<li>To unlawfully gather information about others.</li>\n</ul>\n<h2><a name=\"_Toc79984966\"></a><strong>11) ASSUMPTION OF RISK</strong></h2>\n<p>The Platform and Services are provided for communication purposes only. You acknowledge and agree that any information posted on Our Platform is not intended to be legal advice, medical advice, or financial advice, and no fiduciary relationship has been created between you and us. You further agree that your purchase of any of the products on the Platform is at your own risk. We do not assume responsibility or liability for any advice or other information given on the Platform.</p>\n<h2><a name=\"_Toc79984967\"></a><strong>12) REVERSE ENGINEERING &amp; SECURITY</strong></h2>\n<p>You agree not to undertake any of the following actions:</p>\n<ol>\n<li>a) Reverse engineer, or attempt to reverse engineer or disassemble any code or software from or on the Platform or Services;</li>\n<li>b) Violate the security of the Platform or Services through any unauthorized access, circumvention of encryption or other security tools, data mining, or interference to any host, user, or network.</li>\n</ol>\n<h2><a name=\"_Toc79984968\"></a><strong>13) INDEMNIFICATION</strong></h2>\n<p>You agree to defend and indemnify us and any of our affiliates (if applicable) and hold us harmless against any legal claims and demands, including reasonable attorney\'s fees, which may arise from or relate to your use or misuse of the Platform or Services, your breach of this agreement, or your conduct or actions. You agree that we shall be able to select its legal counsel and may participate in its defense if we wish.</p>\n<h2><a name=\"_Toc79984969\"></a><strong>14) EXCLUSION OF LIABILITY</strong></h2>\n<p>You understand and agree that we (A) do not guarantee the accuracy, completeness, validity, or timeliness of information listed by us or any third parties; and (B) shall not be responsible for any materials posted by us or any third party. You shall use your judgment, caution, and common sense in evaluating any prospective methods or offers and any information provided by us or any third party.</p>\n<p>Further, we shall not be liable for direct, indirect consequential, or any other form of loss or damage that may be suffered by a user through the use of the Vwanu Platform including loss of data or information or any kind of financial or physical loss or damage.</p>\n<p>In no event shall Vwanu  , nor its Owner, directors, employees, partners, agents, suppliers, or affiliates, be accountable for any indirect, incidental, special, eventful, or exemplary costs, including without limitation, loss of proceeds, figures, usage, goodwill, or other intangible losses, consequential from (i) your use or access of or failure to access or use the Service; (ii) any conduct or Content of any third party on the Service; (iii) any content attained from the Service; and (iv) unlawful access, use or alteration of your transmissions or Content, whether or not based on guarantee, agreement, domestic wrong (including carelessness) or any other lawful concept, whether or not we\'ve been aware of the possibility of such damage, and even if a cure set forth herein is originated to have futile of its important purpose.</p>\n<h2><a name=\"_Toc79984970\"></a><strong>15) SPAM POLICY</strong></h2>\n<p>You are strictly prohibited from using the Platform or any of our Services for illegal spam activities, including gathering email addresses and personal information from others or sending any mass commercial emails.</p>\n<h2><a name=\"_Toc79984971\"></a><strong>16) THIRD-PARTY LINKS &amp; CONTENT</strong></h2>\n<p>We may occasionally post links to third-party Apps or other services. You agree that we are not responsible for any loss or damage caused as a result of your use of any third-party services linked to or from Our Platform.</p>\n<h2><a name=\"_Toc79984972\"></a><strong>17) MODIFICATION &amp; VARIATION</strong></h2>\n<p>We may, from time to time and at any time without notice to you, modify this agreement. You agree that we have the right to modify this agreement or revise anything contained herein. You further agree that all modifications to this agreement are in full force and effect immediately upon posting on the Platform and that modifications or variations will replace any prior version of this agreement unless prior versions are specifically referred to or incorporated into the latest modification or variation of this agreement.</p>\n<h2><a name=\"_Toc79984973\"></a><strong>18) ENTIRE AGREEMENT</strong></h2>\n<p>This agreement constitutes the entire understanding between the Parties concerning any use of this Platform. This agreement supersedes and replaces all prior or contemporaneous agreements or understandings, written or oral, regarding the use of this Platform.</p>\n<h2><a name=\"_Toc79984974\"></a><strong>19) SERVICE INTERRUPTIONS</strong></h2>\n<p>We may need to interrupt your