r systems);</li>\n<li>Protect the safety and security of our products, systems, and users;</li>\n<li>Comply with a legal obligation, such as the preservation of evidence; or</li>\n<li>Comply with a request of judicial or administrative authority, law enforcement, or a government agency;</li>\n<li>In which case, the Content will be retained for no longer than is necessary for the purposes for which it has been retained (the exact duration will vary on a case-by-case basis).</li>\n<li>If you delete or disable your account, these Terms shall terminate as an agreement between you and us, but this section and the section below called \"our agreement and what happens if we disagree\" will still apply even after your account is terminated, disabled, or deleted.</li>\n</ul>\n<h2><a name=\"_Toc79984976\"></a><strong>21) NO WARRANTIES</strong></h2>\n<p>You agree that your use of the Platform and Services is at your sole and exclusive risk and that any Services provided by us are on an \"As Is\" basis. We hereby expressly disclaim any express or implied warranties of any kind, including, but not limited to the implied warranty of fitness for a particular purpose and the implied warranty of merchantability. We make no warranties that the Platform or Services will meet your needs or that the Platform or Services will be uninterrupted, error-free, or secure. We also make no warranties as to the reliability or accuracy of any information on the Platform or obtained through the Services. You agree that any damage that may occur to you, through your computer system, or as a result of the loss of your data from your use of the Platform or Services is your sole responsibility and that we are not liable for any such damage or loss.</p>\n<h2><a name=\"_Toc79984977\"></a><strong>22) LIMITATION ON LIABILITY</strong></h2>\n<p>We are not liable for any damages that may occur to you as a result of your use of the Platform or Services, to the fullest extent permitted by law. This section applies to any claims by you, including, but not limited to, lost profits or revenues, consequential or punitive damages, negligence, strict liability, fraud, or torts of any kind.</p>\n<h2><a name=\"_Toc79984978\"></a><strong>23) DISCLAIMER</strong></h2>\n<ul>\n<li>You are responsible for your own health Vwanu is not a medical service and is not to be used to seek, and APP not providing, medical treatment or advice. Information made available through the Services and by our partners and affiliates shall solely be used for recreational and educational purposes.</li>\n<li>You use the Service at your own risk. The Service is provided “AS IS”, without any warranties, and Vwanu does not warrant that the Service and availability thereof will be uninterrupted or error-free. PLATFORM does not assume any responsibility for errors or omissions in the information or software or other documents, including User Content, which are referenced by or linked to. References or links to third parties’ website s are provided “AS IS” without warranty of any kind, either express or implied.</li>\n<li>PLATFORM cannot guarantee that the information provided in our database is accurate, reliant, or complete. Vwanu is not responsible for any personal injury or any other damages that may have been the result, direct or indirect, of any use or misuse of the Services.</li>\n<li>Our PLATFORM or Services may be temporarily unavailable from time to time for maintenance or other reasons Vwanu assumes no responsibility for any error, omission, interruption, deletion, defect, delay in operation or transmission, communications line failure, theft or destruction, or unauthorized access to, or alteration of, User communications.</li>\n<li>Under no circumstances will Vwanu. be responsible for any loss or damage, including any loss or damage or personal injury or death, resulting from anyone’s use of our PLATFORM or Services, or any interactions between Users or Coach of our PLATFORM or Services, whether online or offline Vwanu reserves the right to change any Content, video and other items used or contained in our PLATFORM or Services, at any time without notice. Reference to any products, services, processes, or other information, by trade name, trademark, manufacturer, supplier or otherwise does not constitute or imply endorsement, sponsorship or recommendation thereof, or any affiliation therewith, by our website, by third parties or by any of the equipment or programming associated with or utilized by our Services.</li>\n<li>In no event shall Vwanu or its affiliates, officers, and/or employees be liable concerning PLATFORM for (i) in the aggregate, any amount above the fees paid by you to subscribe to Vwanu (ii) lost profits, lost data, o failure to meet any duty including without limitation good faith and reasonable care arising out of your access to or use Vwanu; or (iii) any direct, indirect, incidental, punitive, special, exemplary, or consequential damages of any kind whatsoever.</li>\n<li>You agree that this limitation of liability is a reasonable allocation of risk and is a fundamental element of the basis of the bargain between Vwanu and you. You understand that Vwanu would not be provided without such limitations. Some jurisdictions do not allow the limitations in this section, so they may not apply to you.</li>\n<li>Without limiting the foregoing, you understand and agree that you download or otherwise obtain Content and related Content from or through our PLATFORM or services at your own risk and that you will be solely responsible for your use thereof and any damages to your mobile device or computer system, loss of data or other harm of any kind that may result. we, as well as all of our affiliates, are not liable for any indirect, special, incidental, or consequential damages (including damages for loss of business, loss of profits, litigation, or the like), whether based on breach of contract, breach of warranty, tort (including negligence), product liability or otherwise, even if advised of the possibility of such damages. the negation and limitation of damages set forth above are fundamental elements of the basis of the bargain between you and Vwanu.</li>\n<li>Our PLATFORM and services would not be provided without such limitations. no advice or information, whether oral or written, obtained by you from us through our PLATFORM or services shall create any warranty, representation, or guarantee not expressly stated in this agreement.</li>\n<li>If you have any specific questions about any medical matter, you should consult your doctor or another professional healthcare provider.</li>\n<li>If you think you may be suffering from any medical condition you should seek immediate medical attention from a doctor or Physician.</li>\n<li>The Content on this PLATFORM is provided for informational purposes only and is not intended to be a substitute for professional or safety advice. At any time, you have questions regarding a specific situation; you should seek the advice of a professional.</li>\n</ul>\n<h2><a name=\"_Toc79984979\"></a><strong>24) GENERAL PROVISIONS:</strong></h2>\n<ol>\n<li><strong>JURISDICTION, VENUE &amp; CHOICE OF LAW</strong>: The terms herein will be governed by and construed by the laws of the United States without giving effect to any principles of conflicts of law. The Courts of the United States shall have exclusive jurisdiction over any dispute arising from the use of the Platform.</li>\n<li><strong>ASSIGNMENT:</strong> This Agreement, or the rights granted hereunder, may not be assigned, sold, leased, or otherwise transferred in whole or part by you. Should this agreement, or the rights granted hereunder, be assigned, sold, leased, or otherwise transferred by us, the rights and liabilities of <strong>Vwanu </strong>will bind and inure to any assignees, administrators, successors, and executors.</li>\n<li><strong>SEVERABILITY</strong>: If any part or sub-part of this agreement is held invalid or unenforceable by a court of law or competent arbitrator, the remaining parts and sub-parts will be enforced to the maximum extent possible. In such a condition, the remainder of this agreement shall continue in full force.</li>\n<li><strong>SUSPENSION AND TERMINATION </strong>We may suspend or terminate your user account or temporarily disable access to whole or part of any Service in the event of any suspected illegal activity, extended periods of inactivity, or requests by law enforcement or other government agencies. Objections to suspension or disabling of user accounts should be made at Vwanu within thirty days of being notified about the suspension.</li>\n<li><strong>NO WAIVER</strong>: If we fail to enforce any provision of this agreement, this shall not constitute a waiver of any future enforcement of that provision or any other provision. Waiver of any part or sub-part of this agreement will not constitute a waiver of any other part or sub-part.</li>\n<li><strong>CONFIDENTIALITY </strong>You shall agree and acknowledge that you may have access to certain information and materials, including the terms of the agreement, concerning the business, clients, business writings, employee’s information, business technologies that we use, products and services of the other party, that are business secrets and confidential information. You shall note except with your prior permission, replicate, reproduce, use, share, and disclose to any other third-party any Confidential Information or business secrets. You shall return to us or destroy the business secrets or Confidential Information promptly upon our written request.</li>\n<li><strong>HEADINGS FOR CONVENIENCE ONLY:</strong> Headings of parts and sub-parts under this agreement are for convenience and organization, only. Headings shall not affect the meaning of any provisions of this agreement.</li>\n<li><strong>NO AGENCY, PARTNERSHIP, OR JOINT VENTURE:</strong> No agency, partnership, or joint venture has been created between the Parties as a result of this agreement. No Party has any authority to bind the other to third parties.</li>\n<li><strong>FORCE MAJEURE</strong>: We are not liable for any failure to perform due to causes beyond its reasonable control including, but not limited to, acts of God, acts of civil authorities, acts of military authorities, riots, embargoes, acts of nature, and natural disasters, and other acts which may be due to unforeseen circumstances, i.e., COVID-19!</li>\n</ol>\n<ol start=\"10\">\n<li><strong>ELECTRONIC COMMUNICATIONS PERMITTED</strong>: Electronic communications are permitted to both Parties under this agreement, including e-mail. For any questions or concerns, please use the contact us form on the Platform or email us at info@vwanu.com</li>\n<li><strong>END OF TERMS OF SERVICE</strong></li>\n</ol>\n<p>If you have any questions or concerns regarding this agreement, please contact us.</p>\n<p> </p>\n<p><strong>Vwanu</strong></p>\n<p>United States</p>\n<p>info@vwanu.com</p>\n<p> </p>\n<p>This Document is last updated on August 20, 2021</p>\n<p> </p>\n<p> </p>');
