d by us or any of our Service Providers (characterized underneath), if you don\'t mind just don\'t enter our Platform or utilize our Services.</li>\n<li>You may likewise decide not to give us \"discretionary\" Personal Data, however please remember that without it we will most likely be unable to give you the full scope of our administrations or with the best client experience when utilizing our Services.</li>\n<li><a href=\"../\"><strong>Vwanu</strong></a> Provides social media platform.</li>\n</ul>\n<h2><a name=\"_Toc79984730\"></a><a name=\"_Toc80400231\"></a><strong>What private data do we collect from the people who visit our Platform?</strong></h2>\n<p>When enlisting on our Platform, as suitable, you could be approached to type in your name, email, address information, or different subtleties to assist you with your experience.</p>\n<p>When you create an account and use the Services, including through a third-party platform, we collect any data you provide directly, including:</p>\n<ul>\n<li><a name=\"_Toc79984731\"></a><a name=\"_Toc80400232\"></a><strong>Account Data:</strong> To use certain features, you need to create a user account. When you create or update your account, we collect and store the Data you provide, like your email address, password, gender, and date of birth, and assign you a unique identifying number (\"Account Data\").</li>\n</ul>\n<ul>\n<li><strong>Location Data:</strong> is information that is derived from your GPS, Wi-Fi, compass, accelerometer, IP address, or public posts that contain location information. Location information will be disclosed (either to us, to other users, or both):\n<ul>\n<li>when you use location-based features, such as People Nearby, POI search, and when you share your location with other <a href=\"../\"><strong>Vwanu</strong></a> users; and</li>\n<li>when you access <a href=\"../\"><strong>Vwanu</strong></a>, we derive location information from your IP address, device, or internet service to prevent multiple or