implied guarantees, warranties, representations, or other terms and conditions relating to these Terms or their subject matter, not contained in these Terms, are excluded from these Terms to the maximum extent permitted by applicable laws and regulations.</p>\n<p>Nothing in these Terms excludes, restricts or modifies any guarantee, warranty, term or condition, right or remedy implied or imposed by any applicable laws and regulations which cannot lawfully be excluded, restricted or modified.</p>\n<p>If any guarantee, condition, warranty or term is implied or imposed by any applicable laws and regulations and cannot be excluded (a \"Non-Excludable Provision\"), and we are able to limit your remedy for a breach of the Non-Excludable Provision, then our liability for breach of the Non-Excludable Provision is limited to one or more of the following at our option:</p>\n<ul>\n<li>in the case of goods, the replacement of the goods or the supply of equivalent goods, the repair of the goods, the payment of the cost of replacing the goods or of acquiring equivalent goods, or the payment of the cost of having the goods repaired; or</li>\n<li>in the case of services, the supplying of the services again, or the payment of the cost of having the services supplied again.</li>\n</ul>\n<h2><a name=\"_Toc79984744\"></a><a name=\"_Toc80400242\"></a><strong>Customer Data Processing Appendix:</strong></h2>\n<p><strong>Customer Data</strong>\" means any personal data that <a href=\"../\"><strong>Vwanu</strong></a> processes on behalf of Customer via the Service, as more particularly described in this DPA.</p>\n<p>\"<strong>Data Protection Laws</strong>\" signifies all information protection laws and guidelines appropriate to a gathering\'s handling of Customer Data under the Agreement, including, where pertinent, EU Data Protection Law and Non-EU Data Protection Laws.</p>\n<h2><a name=\"_Toc79984745\"></a><a name=\"_Toc80400243\"></a>GDPR-Eu Data Protection Law </h2>\n<p>\"<strong>EU Data Protection Law</strong>\" signifies all data protection laws and guidelines appropriate to Europe, including (I) Regulation 2016/679 of the European Parliament and the Council on the insurance of ordinary people concerning the preparing of individual information and on the free development of such information <strong>(General Data Protection Regulation)</strong> <strong>(\"GDPR\");</strong> (ii) Directive 2002/58/EC concerning the processing of personal data and the protection of privacy in the electronic communications sector; (iii) applicable national implementations of (i) and (ii); and (iii) in respect of the United Kingdom (\"UK\") any applicable national legislation that replaces or converts in domestic law the GDPR or any other law relating to Data and privacy as a consequence of the UK leaving the European Union).</p>\n<p>\"Europe\" signifies, for the motivations behind this DPA, the European Union, the European Economic Area as well as their part states, Switzerland and the United Kingdom.</p>\n<p>\"Non-EU Data Protection Laws\" means the California Consumer Privacy Act (\"CCPA\"); the Canadian Personal Information Protection and Electronic Documents Act (\"PIPEDA\"); and the Brazilian General Data Protection Law (\"LGPD\"), Federal Law no. 13,709/2018.</p>\n<ul>\n<li><strong>Parties\' roles: </strong>If EU Data Protection Law or the LGPD applies to either party\'s processing of Customer Data, the parties acknowledge and agree that about the processing of Customer Data, Customer is the controller and <a href=\"../\"><strong>Vwanu</strong></a> is a processor acting on behalf of Customer, as further described in Annex A (Details of Data Processing) of this DPA.</li>\n<li><strong>Purpose limitation:</strong> Vwanu shall process Customer Data only following Customer’s documented lawful instructions as outlined in this DPA, as necessary to comply with applicable law, or as otherwise agreed in writing (\"Permitted Purposes\"). The parties agree that the Agreement sets out the Customer’s complete and final instructions to Vwanu to processing Customer Data. Processing outside the scope of these instructions (if any) shall require a prior written agreement between the parties.</li>\n<li><strong>Customer compliance:</strong> Customer represents and warrants that (i) it has complied, and will continue to comply, with all applicable laws, including Data Protection Laws, in respect of its processing of Customer Data and any processing instructions it issues to Vwanu; and (ii) it has provided, and will continue to provide, all notice and has obtained, and will continue to obtain, all consents and rights necessary under Data Protection Laws for <a href=\"../\"><strong>Vwanu</strong></a> to process Customer Data for the purposes described in the Agreement. Customer shall have sole responsibility for the accuracy, quality, and legality of Customer Data and how Customer acquired Customer Data. Without prejudice to the generality of the preceding, Customer agrees that it shall be responsible for complying with all laws (including Data Protection Laws) applicable to any emails or other content created, sent, or managed through the Service, including those relating to obtaining consents (where required) to send emails, the content of the emails and its email deployment practices.</li>\n<li><strong>Lawfulness of Customer\'s instructions: </strong>Customer will ensure that <a href=\"../\"><strong>Vwanu</strong></a>’s processing of the Customer Data in accordance with Customer’s instructions will not cause Vwanu to violate any applicable law, regulation, or rule, including, without limitation, Data Protection Laws. Vwanu shall promptly notify Customer in writing, unless prohibited from doing so under EU Data Protection Laws, if it becomes aware or believes that any data processing instruction from Customer violates the GDPR or any UK implementation of the GDPR.</li>\n</ul>\n<h3><a name=\"_Toc79984746\"></a><a name=\"_Toc80400244\"></a><strong>California Online Privacy Protection Act</strong></h3>\n<p>CCPPA is the first state law in the country to require commercial Platforms and online services to create an online privacy policy.</p>\n<p>The law’s reach extends well beyond California to require anybody or company in America (and possibly the entire world) that functions Platforms collecting (PII) Personally Identifiable Information from California consumers to create a visible online privacy policy on its Platform declaring the information being accumulated and the individuals or companies with whom it has been distributed. –See more at <a href=\"https://consumercal.org/about-cfc/cfc-education-foundation/california-online-privacy-protection-act-caloppa-3/\">https://consumercal.org/about-cfc/cfc-education-foundation/california-online-privacy-protection-act-caloppa-3/</a></p>\n<h3><a name=\"_Toc79984747\"></a><a name=\"_Toc80400245\"></a><strong>According to CalOPPA, we agree to the following:</strong></h3>\n<ul>\n<li>Users can visit our Platform anonymously.</li>\n<li>Once this online privacy policy is established, we will put a link to it on our Platform, on the first significant web page after getting into our Platform.</li>\n<li>Request we disclose to you free of charge the following information covering the 12 months preceding your request:</li>\n<li>The categories of personal information about you that we collected;</li>\n<li>The categories of sources from which the personal information was collected;</li>\n<li>The purpose for collecting personal information about you;</li>\n<li>The categories of third parties to whom we disclosed personal information about you and the categories of personal information that was disclosed (if applicable) and the purpose for disclosing the personal information about you; and</li>\n<li>The specific pieces of personal information we collected about you;</li>\n<li>Our online privacy policy link includes the term ‘privacy’ and can certainly be on the page given above.</li>\n<li>You’ll be notified of any online privacy policy changes:</li>\n<li>Via email</li>\n</ul>\n<h3><a name=\"_Toc79984748\"></a><a name=\"_Toc80400246\"></a><strong>Your Brazilian Privacy Rights</strong></h3>\n<p>If you are located in Brazil, you may learn more about your Brazilian privacy rights. users and others who reside in Brazil (“consumers” or “you”). We adopt this notice to comply with the Brazilian Data Protection Law Lei Geral de Proteção de Dados Pessoais (Law No. 13,709/2018) (\"LGPD\"). Any terms defined in the LGPD have the same meaning when used in this notice.</p>\n<h4><strong>LGPD</strong></h4>\n<p>On September 18, 2020, the Lei Geral de Proteção de Dados Pessoais (LGPD) will come into effect for Brazilian residents. The LGPD embraces many of the privacy rights for which we have advocated for years. We want to assure you that we still advocate for those rights and more. For those of you who are located in Brazil, this page will help you understand the LGPD and our compliance with it.</p>\n<p>In addition to the rights outlined in the <a href=\"../\"><strong>Vwanu</strong></a> Privacy Policy, as a user located in Brazil, you may be able to exercise the following rights with respect to your personal information that we have collected, subject to certain limitations:</p>\n<ul>\n<li>The right to confirmation of the existence of the processing. You have the right to ask that we confirm whether we process your personal data.</li>\n<li>The right to access the data. You have the right to access the personal Data we hold about you and certain information about how we use it and who we share it with, including information about any public and private entities we have shared your personal data with. Most of this Data can be reviewed in your account panel and related content and services that you have purchased.</li>\n<li>The right to correct incomplete, inaccurate or out-of-date data. If you want to correct or revise any of the data, we retain on you, you may do so by accessing your account and the information contained within it. This includes Who is information collected for domains that you have purchased.</li>\n<li>The right to anonymize, block, or delete unnecessary or excessive data or data that is not being processed in compliance with the LGPD. Please note that, depending on the request, this may result in a suspension or discontinuation of certain services and is also governed by legal and/or contractual retention guidelines.</li>\n<li>The right to the portability of data to another service provider, by means of an express request. We provide you with the ability to move any of your account data to a third party, at any time.</li>\n<li>The right to delete personal data processed with the consent of the data subject. You have a right to request the permanent deletion of your data, subject to certain exceptions. However, please note that exercising this right may result in a suspension or discontinuation of services and is also governed by legal and/or contractual retention guidelines.</li>\n<li>The right to information about the possibility of not giving consent and about the consequences of the refusal. You have the right to ask us to provide information about the possibility of not giving consent for the processing of your personal data and the consequences of such refusal.</li>\n<li>The right to revoke consent.</li>\n</ul>\n<p>Please note that not all of these rights listed above are absolute, and limitations/exceptions apply in some cases. For example, we may not be able to fully comply with your request if we are bound by certain legal restrictions or contractual requirements, but in those circumstances, we will still respond to notify you of such a decision.</p>\n<h5><strong>Exercising Data Portability and Deletion Rights</strong></h5>\n<p>To exercise the data portability and deletion rights described above, please submit a verifiable consumer request to us by:</p>\n<ul>\n<li>You can contact us Contact Us</li>\n<li>We will need to verify your identity before processing your request. The verifiable consumer request must:</li>\n<li>Provide sufficient information that allows us to reasonably verify you are the person about whom we collected personal information or a legal representative.</li>\n<li>Describe your request with sufficient detail that allows us to properly understand, evaluate and respond to it.</li>\n</ul>\n<p>We cannot respond to your request or provide you with personal information if we cannot verify your identity or authority to make the request and confirm the personal information relates to you. Making a verifiable consumer request does not require you to create an account with us. We will only use personal information provided in a verifiable consumer request to verify the requestor\'s identity or authority to make the request.</p>\n<h3><a name=\"_Toc79984749\"></a><a name=\"_Toc80400247\"></a><strong>How does our Platform handle Do Not Track signals?</strong></h3>\n<p>We honor USUALLY DO NOT Track signals and don’t Track, place cookies, or use advertising whenever a Do Not Track (DNT) browser method is set up.</p>\n<h3><a name=\"_Toc79984750\"></a><a name=\"_Toc80400248\"></a><strong>COPPA (Children Online Privacy Protection Action)</strong></h3>\n<p>With regards to the assortment of private information from children under age 13 years, the Children’s Online Privacy Protection Act (COPPA) puts parents in charge. The Federal Trade Commission, United States’ consumer safety firm, enforces the COPPA Guideline, which spells out what providers of Platforms and online services should do to safeguard children privatizes and security online.</p>\n<h3><a name=\"_Toc79984751\"></a><a name=\"_Toc80400249\"></a><strong>Fair Information Practices</strong></h3>\n<p>The fair Information Practices Rules form the backbone of level of privacy law and the ideas they include have played an important role in the introduction of data protection laws and regulations around the world. Understanding the Good Information Practice Guidelines and how they must be implemented is fundamental to adhere to the various privation laws and regulations that protect private information.</p>\n<p><strong><em>To become consistent with Fair Information Methods we will need the following responsive action, should a data breach happen:</em></strong></p>\n<ul>\n<li>We will inform you via email</li>\n<li>within 7 business days</li>\n<li>We will inform the users via in-Platform notification</li>\n<li>Within 1 working day</li>\n</ul>\n<p>We also agree to the average person Redress Rule which requires that peoples have the right to legally go after enforceable privileges against data collectors and processors who neglect to adhere to the law. This theory requires not just that people have enforceable protection under the law against data users, but also that person have recourse to courts or federal government agencies to research and/or prosecute non-compliance by data processors.</p>\n<h3><a name=\"_Toc79984752\"></a><a name=\"_Toc80400250\"></a><strong>CAN-SPAM Act</strong></h3>\n<p>The CAN-SPAM Take action is a regulation that sets the guidelines for commercial email, establishes requirements for commercial announcements, offers recipients to have emails ceased from being delivered to them, and spells out hard fines for violations.</p>\n<h3><a name=\"_Toc79984753\"></a><a name=\"_Toc80400251\"></a>We accumulate your email to be able to:</h3>\n<ul>\n<li>Send information, react to questions, and/or other demands or questions</li>\n<li>To maintain compliance with CANSPAM, we consent to the next:</li>\n<li>Not use untrue or misleading subject matter or email addresses.</li>\n<li>Identify the concept as an advertisement in some realistic way.</li>\n<li>Include the physical address of our Platform headquarters or business</li>\n<li>Screen third-party email marketing services for conformity, if one can be used.</li>\n<li>Honor opt-out/unsubscribe demands quickly.</li>\n<li>Allow users to unsubscribe utilizing the link at the bottom of every email.</li>\n<li>If anytime you want to unsubscribe from receiving future email, you can email us at by using contact form at our Platform <a href=\"../\"><strong>Vwanu</strong></a> and we’ll immediately remove you from ALL communication.</li>\n</ul>\n<h2><a name=\"_Toc79984754\"></a><a name=\"_Toc80400252\"></a><strong>How do we protect your details?</strong></h2>\n<ul>\n<li>We do not use vulnerability scanning and/or scanning to PCI specifications.</li>\n<li>We only provide articles and information. We never require credit card volumes.</li>\n<li>We use regular Malware Scanning.</li>\n<li>Your individual information is comprised behind secured systems and is merely accessible by a restricted number of folks who’ve special access privileges to such systems, and must keep carefully the information confidential. Furthermore, all very sensitive/credit information you resource is encrypted via Secure Socket Layer (SSL) technology.</li>\n<li>We implement a number of security measures whenever a user gets into, submits, or accesses their information to keep up the protection of your individual information.</li>\n</ul>\n<p>All deals are processed through the gateway service provider and aren’t stored or refined on our machines.</p>\n<h2><a name=\"_Toc79984755\"></a><a name=\"_Toc80400253\"></a><strong>Do we use ‘cookies?</strong></h2>\n<p>Yes. Cookies are small documents a Platform or its provider exchanges to your computer’s hard drive through your Browser (if you allow) that permits the Platform’s or service provider’s systems to identify your internet browser and capture please remember certain information. For example, we use cookies to help us keep in mind and process the things in your shopping cart software. Also, they are used to help us understand your requirements based on prior or current Platform activity, which permits us to offer you improved upon services. We also use cookies to help us put together aggregate data about Platform traffic and Platform conversation so that people may offer better Platform experience and tools in the foreseeable future.</p>\n<h3><a name=\"_Toc79984756\"></a><a name=\"_Toc80400254\"></a><strong>We use cookies to:</strong></h3>\n<ul>\n<li>Understand and save user’s tastes for future views or visits of our Website.</li>\n<li>Keep an eye on advertisements.</li>\n<li>Compile aggregate data about Website traffic and Website connections in order to provide better Website activities and tools in the foreseeable future.</li>\n<li>We also use third party advertisements on <a href=\"../\"><strong>Vwanu</strong></a> to support our Website. Some of these advertisers may use technology such as cookies and web beacons when they advertise on our Website, which will also send these advertisers (such as Google through the Google AdSense program) information including your IP address, your ISP, the browser you used to visit our Website, and in some cases, whether you have Flash installed. This is generally used for geotargeting purposes (Serving Online Booking ads to Travelers) or showing certain ads based on specific Websites visited (such as showing marketing ads to someone who frequents marketing Websites or blogs).</li>\n<li><em>We might also use third-party services that monitor these details on our behalf.</em></li>\n</ul>\n<p>You are able to choose that your personal computer warns you whenever a cookie has been directed, or you can select to carefully turn off all cookies. You can perform that through your web browser settings. Since internet browser is just a little different, check out your browser’s Help Menu to learn the way in which to change your cookies.</p>\n<p>If you change cookies off, a number of the features that produce your Website experience better might not exactly function properly. It will not have an impact on the user’s experience that produces your Website experience better and might not exactly function properly.</p>\n<h2><a name=\"_Toc79984757\"></a><a name=\"_Toc80400255\"></a><strong>Limitation of Liability</strong></h2>\n<ul>\n<li>Some jurisdictions do not allow the limitation or exclusion of liability for incidental or consequential damages so some of the above limitations may not apply to you.</li>\n<li>We make no legal representation that the Website or services are appropriate or available for use in locations outside UNITED STATES. You may access the Website from outside UNITED STATES.at your own risk and initiative and must bear all responsibility for compliance with any applicable foreign laws.</li>\n</ul>\n<h3><a name=\"_Toc79984758\"></a><a name=\"_Toc80400256\"></a><strong>Indemnification</strong></h3>\n<ul>\n<li>Upon visiting this Website you agree release, indemnify, defend and hold harmless <a href=\"../\"><strong>Vwanu</strong></a> and any of its contractors, agents, employees, officers, directors, shareholders, affiliates and assigns from all liabilities, claims, damages, costs and expenses, including reasonable attorneys’ fees and expenses, of third parties relating to or arising out of your use of the Website content; your use of the services; your violation of any provision of these terms; any unauthorized information or data you supplied to us. You will have sole responsibility to defend us against any claim, but you must receive our prior written consent regarding any related settlement.</li>\n</ul>\n<h3><a name=\"_Toc79984759\"></a><a name=\"_Toc80400257\"></a><strong>Governing Law and Jurisdiction</strong></h3>\n<ul>\n<li>This Website originates from the UNITED STATES. The laws of UNITED STATES. Without regard to its conflict of law, principles will govern these terms to the contrary. You, hereby agree that, all disputes arising out of or in connection with these terms shall be submitted to the exclusive jurisdiction of the UNITED STATES. By using this Website, you consent to the jurisdiction and venue of such courts in connecti